64\u30b3\u30b9\u30d1\u3088\u3057\u2605", "        \u2733\ufe0e\u767e\u3005\u5c4b@\u6c34\u9053\u6a4b\u6c34\u9053\u6a4b\u99c5\u3092\u51fa\u3066\u3059\u3050\u306e\u30d3\u30eb\u306b\u5165\u3063\u3066\u3044\u308b\u304a\u5e97\u3002\u99c5\u304b\u3089\u3059\u3050\u306a\u306e\u3067\u308f\u304b\u308a\u3084\u3059\u3044\u4e0a\u3001\u3068\u3066\u3082\u5165\u308a\u3084\u3059\u3044\u96f0\u56f2\u6c17\u3067\u3059\u3002\u5e2d\u306f\u5168\u3066\u500b\u5ba4\u3067\u3068\u3063\u3066\u3082\u843d\u3061\u7740\u304f\u9593\u53d6\u308a\u3002\u79c1\u306e\u90e8\u5c4b\u306f\u30ab\u30fc\u30c6\u30f3\u3067\u5eca\u4e0b\u3068\u9694\u3066\u3089\u308c\u3066\u304a\u308a\u3001\u5468\u308a\u306e\u5bb4\u4f1a\u306e\u58f0\u3082\u307b\u3068\u3093\u3069\u6c17\u306b\u306a\u308a\u307e\u305b\u3093\u3002\u79c1\u306f\u30b4\u30fc\u30eb\u30c9\u30b3\u30fc\u30b9\u3092\u3044\u305f\u3060\u304d\u307e\u3057\u305f\u3002\u96f2\u4e39\u3068\u87f9\u306e\u8336\u7897\u84b8\u3057 \uff5e\u65b0\u9bae\u306a\u65e8\u307f\u304c\u5e83\u304c\u308b\uff5e\u2605\u3046\u306b\u304c\u305f\u3063\u3077\u308a\u30fc\uff01\u7d05\u8336\u9d28\u3068\u5927\u6839\u306e\u6885\u8089\u548c\u3048\u3000\uff5e\u30d6\u30e9\u30f3\u30c9\u9d28\u4f7f\u7528\uff5e\u2605\u6885\u30bd\u30fc\u30b9\u3092\u304b\u3051\u3066\u3044\u305f\u3060\u304d\u307e\u3059\u3002\u5927\u6839\u306e\u30b7\u30e3\u30ad\u30b7\u30e3\u30ad\u3057\u305f\u98df\u611f\u304c\u3068\u3066\u3082\u697d\u3057\u3044\u3067\u3059\u3002\u65ec\u9bae\u9b5a\u306e\u523a\u8eab\u76db\u308a\u5408\u308f\u305b\u2605\u306a\u3093\u3068\u8c6a\u83ef\u306a\u76db\u308a\u5408\u308f\u305b\uff01\uff01\uff01\u30a6\u30de\u30ba\u30e9\u30cf\u30ae\u306f\u521d\u3081\u3066\uff01\uff01\u809d\u3068\u4e00\u7dd2\u306b\u3044\u305f\u3060\u304f\u3068\u3001\u3068\u3066\u3082\u76f8\u6027\u304c\u3088\u3044\u3067\u3059\u306d\uff01\u30db\u30a6\u30dc\u30a6\u306f\u5f3e\u529b\u304c\u3042\u3063\u3066\u98df\u611f\u3082\u826f\u3044\u3067\u3059\u3002\u30ab\u30f3\u30d1\u30c1\u306f\u3057\u3063\u304b\u308a\u8102\u3082\u306e\u3063\u3066\u3044\u307e\u3057\u30