e2\u30f3\uff06\u7cbe\u8089\u88cf\u30e1\u30cb\u30e5\u30fc\u3001\u8c5a\u30db\u30eb\u30e2\u30f3\u3001\u725b\u30db\u30eb\u30e2\u30f3\u3001\u304a\u8089\u30e1\u30cb\u30e5\u30fc\u3001\u91ce\u83dc\u30e1\u30cb\u30e5\u30fc\u3001\u8089\u523a\u3057\u8eab\u30e1\u30cb\u30e5\u30fc\u3002\u4e00\u54c1\u6599\u7406\u3001\u3054\u98ef\u7269\u3001\u30b9\u30fc\u30d7\u3001\u30b9\u30a4\u30fc\u30c4\u3001\u30db\u30eb\u30e2\u30f3\u306e\u898b\u53d6\u308a\u56f3\u3001\u30b8\u30f3\u3068\u8089\u3001\u30dd\u30a4\u30f3\u30c8\u30b5\u30a4\u30c8\u306e\u6848\u5185\u3001\u6700\u8fd1\u306f\u3084\u3063\u3066\u3044\u308b\u3089\u3057\u3044\u6ce5\u4e80\u3001\u30aa\u30b9\u30b9\u30e1\u306e\u751f\u30de\u30c3\u30b3\u30ea\u3001\u304a\u3059\u3059\u3081\u306e\u30ef\u30a4\u30f3\u30e1\u30cb\u30e5\u30fc\u30015\u306e\u3064\u304f\u65e5\u306e\u30db\u30eb\u30e2\u30f3\u306e\u65e5\u306e\u544a\u77e5\u3067\u30e1\u30cb\u30e5\u30fc\u306f\u4ee5\u4e0a\u3067\u3059\u3002\u307e\u305a\u306f\u540c\u5e2d\u8005\u304c\u6765\u308b\u307e\u3067\u7121\u6599\u306e\u6c34\u3067\u5589\u3092\u6f64\u3057\u307e\u3059\u3002\u540c\u5e2d\u8005\u304c\u5230\u7740\u3057\u305f\u6240\u3067\u304a\u901a\u3057\u306e\u30ad\u30e3\u30d9\u30c4\uff06\u5869\u30c0\u30ec\u304c\u7740\u76bf\uff01\u3000\u30b7\u30e3\u30ad\u30b7\u30e3\u30ad\u7cfb\u98df\u611f\u306e\u30ad\u30e3\u30d9\u30c4\u3068\u3001\u30ad\u30ec\u306e\u826f\u3044\u5869\u30c0\u30ec\u306f\u76f8\u6027\u629c\u7fa4\u3067\u3059\u3002\u30b0\u30ec\u30fc\u30d7\u30d5\u30eb\u30fc\u30c4\u679c\u8089\u305f\u3063\u3077\u308a\u3067\u30b9\u30c3\u30ad\u30ea\u3068\u3057\u305f\u7f8e\u5473\u3057\u3055\u306e\u3056\u304f\u5207\u308a\uff01\u30b0\u30ec\u30fc\u30d7\u30d5\u30eb\u30fc\u30c4\u30b5\u30ef\u30fc480\u5186\u3092\u3054\u304f\u308a\u3068\u98f2\u3093\u3060\u5f8c\u306f\u30ad\u30e0\u30c1380\u5186\u3092\u6ce8\u6587\u3002\u30ad\u30e0\u30c1\u306f\u8f9b\u5473\u3088\u308a\u3082\u7518\u5473\u3068\u65e8\u5473\u304c\u7acb\u3063\u305f\u5473\u308f\u3044\u3067\u3001\u304a\u9152\u306e\u30c4\u30de\u306b\u3074\u3063\u305f\u308a\u306a\u7f8e\u5473\u3057\u3055\u3067\u3059\u3002\u7d9a\u3044\u3066\u306f\u5343\u8449\u306e\u3057\u3044\u305f\u3051580\u5186\u3092\u30aa\u30fc\u30c0\u30fc\u3002\u88cf\u9762\u3092\u8868\u306b\u3057\u3066\u3001\u6c34\u5206\u304c\u8868\u306b\u51fa\u3066\u304f\u308b\u307e\u3067\u713c\u3044\u3066\u3044\u304d\u307e\u3059\u3002\u6c34\u5206\u304c\u3057\u3063\u304b\u308a\u3068\u51fa\u3066\u304d\u305f\u6240\u3067\u3057\u3044\u305f\u3051\u3092\u98df\u3079\u3066\u307f\u308b\u3068\u3001\u65e8\u307f\u305f\u3063\u3077\u308a\u3067\u30b8\u30e5\u30fc\u30b7\u30fc\uff01\u3057\u3063\u304b\u308a\u7f8e\u5473\u3057\u306a\u4e00\u54c1\u3067\u3059\u3002\u7d9a\u3044\u3066\u306f\u30db\u30eb\u30e2\u30f3\u95c7\u76db\u308a1580\u5186\u3092\u6ce8\u6587\u3002\u304a\u76bf\u306b\u5165\u3063\u305f\u30db\u30eb\u30e2\u30f3\u306f\u4e0a\u304b\u3089\u9806\u756a\u306b\u6642\u8a08\u56de\u308a\u306b\u30bf\u30f3\u30ab\u30eb\u30d3\u3001\u767a\u3001\u623f\u7dcf\u30db\u30eb\u30e2\u30f3\uff08\u76f4\u8178\uff09\u3001\u30bf\u30f3\u3001\u98df\u9053\u3001\u6700\u5f8c\u4e2d\u592e\u306b\u6c17\u7ba1\u3092\u76db\u308a\u5408\u308f\u305b\u3066\u3044\u307e\u3059\u3002\u307e\u305a\u306f\u30cf\u30c4\u304b\u3089\u713c\u3044\u3066\u3044\u304f\u3068\u3001\u30cf\u30ea\u304c\u3042\u3063\u3066\u30b8\u30e5\u30fc\u30b7\u30fc\u3067\u30a6\u30de\u30a6\u30de\uff01\u3000\u6c17\u7ba1\u306f\u30b3\u30ea\u30b3\u30ea\u3068\u3057\u305f\u98df\u611f\u306b\u52a0\u3048\u3066\u3001\u65e8\u5473\u304c\u305f\u3063\u3077\u308a\u3067\u3053\u3061\u3089\u3082\u30a6\u30de\u30a4\uff01\u3000\u30bf\u30f3\u30ab\u30eb\u30d3\u306f\u565b\u307f\u3057\u3081\u308b\u305f\u3073\u306b\u65e8\u307f\u305f\u3063\u3077\u308a\uff01\u3000\u98df\u9053\u306f\u30b3\u30ea\u30b3\u30ea\u3068\u3057\u305f\u98df\u611f\u3068\u3068\u3082\u306b\u3001\u60f3\u50cf\u4ee5\u4e0a\u306b\u65e8\u307f\u304c\u305f\u3063\u3077\u308a\u3067\u30d3\u30c3\u30af\u30ea\uff01\u3000\u5206\u539a\u3044\u30bf\u30f3\u306f\u3001\u5927\u5909\u30b8\u30e5\u30fc\u30b7\u30fc\u3067\u65e8\u307f\u3082\u305f\u3063\u3077\u308a\u3002\u6700\u5f8c\u306b\u98df\u3079\u305f\u623f\u7dcf\u30db\u30eb\u30e2\u30f3\u306f\u3001\u8102\u306e\u65e8\u5473\u3001\u7126\u3052\u305f\u9999\u308a\u304c\u3088\u304f\u3001\u30db\u30eb\u30e2\u30f3\u76db\u308a\u5408\u308f\u305b\u306e\u4e2d\u3067\u4e00\u756a\u306e\u7f8e\u5473\u3057\u3055\u3067\u3057\u305f\u3002\u7d9a\u3044\u3066\u306f\u3001\u68a8\u306e\u7f8e\u5473\u3057\u3055\u304c\u6df7\u3056\u3063\u3066\u98f2\u307f\u3084\u3059\u3044\u623f\u7dcf\u30b5\u30ef\u30fc480\u5186\u3092\u30aa\u30fc\u30c0\u30fc\u3002\u3055\u3089\u306b\u725b\u4e00\u672c\u30cf\u30e9\u30df1680\u5186\u3082\u6ce8\u6587\u3057\u307e\u3057\u305f\u3002\u9577\u305550cm\u30aa\u30fc\u30d0\u30fc\u3068\u3042\u3063\u3066\u3001\u30cf\u30e9\u30df\u306f\u5927\u86c7\u306e\u3054\u3068\u304f\u9577\u3044\u59ff\u3092\u3057\u3066\u304a\u308a\u3001\u30b5\u30af\u30c3\u3068\u624b\u969b\u3088\u304f\u5e97\u54e1\u3055\u3093\u306b\u713c\u3044\u3066\u3082\u3089\u3044\u307e\u3059\u3002\u706b\u304c\u5b8c\u5168\u306b\u304a\u8089\u306b\u56de\u308b\u524d\u306b\u30cf\u30e9\u30df\u3092\u30ab\u30c3\u30c8\uff01\u30ab\u30c3\u30c8\uff01\u3000\u30ab\u30c3\u30c8\u4f5c\u696d\u306f\u6642\u9593\u3068\u306e\u52dd\u8ca0\u306e\u3088\u3046\u3067\u3001\u52e2\u3044\u826f\u304f\u30cf\u30e9\u30df\u304c\u76ee\u306e\u524d\u3067\u30ab\u30c3\u30c8\u3055\u308c\u3066\u3044\u304d\u307e\u3059\u3002\u30ab\u30c3\u30c8\u3055\u308c\u3001\u706b\u3082\u3057\u3063\u304b\u308a\u3068\u901a\u3063\u305f\u3068\u3053\u308d\u3067\u98df\u3079\u3066\u307f\u308b\u3068\u3001\u67d4\u3089\u304b\u306a\u98df\u611f\u304b\u3064\u3001\u3055\u3063\u3071\u308a\u3068\u3057\u305f\u5473\u308f\u3044\u3067\u3053\u3061\u3089\u3082\u30a6\u30de\u30a4\uff01\u3000\u8089\u6c41\u3057\u305f\u305f\u308b\u98df\u3079\u3084\u3059\u3044\u90e8\u4f4d\u306e\u713c\u8089\u30e1\u30cb\u30e5\u30fc\u3067\u3057\u305f\u3002\u7d9a\u3044\u3066\u306f\u3001\u306f\u307f\u51fa\u308b\u30ab\u30eb\u30d3\u7684\u306a\u30e1\u30ac\u30ab\u30eb\u30d31660\u5186\u3092\u30aa\u30fc\u30c0\u30fc\uff01\u3000\u307e\u305a\u306f\u8c6a\u5feb\u306b\u30b