ef\u3067\u3057\u305f\u3002\u623f\u7dcf\u30db\u30eb\u30e2\u30f3\u9053\u7384\u5742\u57fa\u5730\u3067\u306f\u3001\u5e97\u540d\u306e\u901a\u308a\u623f\u7dcf\u30a8\u30ea\u30a2\u306b\u3053\u3060\u308f\u3063\u305f\u304a\u8089\u3001\u98df\u6750\u3092\u4f7f\u7528\u3057\u3001\u5e97\u540d\u3068\u4e2d\u8eab\u304c\u3057\u3063\u304b\u308a\u30b7\u30f3\u30af\u30ed\u3057\u3066\u3044\u308b\u3053\u3068\u3082\u3042\u3068\u3067\u5224\u660e\u3057\u307e\u3057\u305f\u3002\u307e\u3060\u51fa\u6765\u305f\u3070\u304b\u308a\u3068\u3042\u3063\u3066\u3001\u4eca\u56de\u59cb\u3081\u3066\u3053\u306e\u304a\u5e97\u306e\u5b58\u5728\u3092\u77e5\u308a\u307e\u3057\u305f\u304c\u3001\u304a\u8089\u3092\u3055\u304f\u3063\u3068\u98df\u3079\u308b\u76ee\u7684\u3067\u3042\u308c\u3070\u305c\u3072\u307e\u305f\u4f7f\u3063\u3066\u307f\u305f\u3044\u306a\u3041\u3068\u611f\u3058\u305f\u3053\u3068\u3082\u3042\u308a\u3001\u6a5f\u4f1a\u304c\u3042\u308c\u3070\u307e\u305f\u884c\u3063\u3066\u307f\u305f\u3044\u3068\u601d\u3044\u307e\u3059\u3002       ", "3999", "3000", "\u591c", "3.9", "1,675", "826", "846"], ["\u3084\u306f\u308a\u30db\u30eb\u30e2\u30f3\u6700\u9ad8\uff01", "\u5e2d\u306b\u7740\u304f\u3068\u4e88\u7d04\u306e\u7d19\u304c\uff56\u305d\u3057\u3066\u307e\u305a\u306f\u30cf\u30a4\u30dc\u30fc\u30eb\u3067\u4e7e\u676f\u266a\u3082\u3084\u3057\u30ca\u30e0\u30eb\u306b\u30ad\u30e0\u30c1\u3001\u306d\u304e\u5869\u3084\u3063\u3053\u3001\u623f\u7dcf\u30b5\u30e9\u30c0\u3068\u3086\u3063\u304f\u308a\u304d\u307e\u3057\u305f\u3088\u3002\u4e03\u8f2a\u306e\u6e96\u5099\u3082\u306d\u3002(\u6700\u8fd1\u6025\u306b\u6691\u304f\u306a\u3063\u3066\u304d\u305f\u306e\u3067\u4e03\u8f2a\u306f\u82e5\u5e72\u3042\u3064\u3044\uff3e\uff3e\uff1b)\u305d\u3046\u305d\u3046\u304a\u8089\u306e\u524d\u306b\u306f\u91ce\u83dc\u3092\u305f\u3063\u3077\u308a\u88dc\u7d66\u3057\u306a\u304d\u3083\u3002(\u3067\u3082\u3053\u308c\u3067\u304a\u8179\u4e00\u676f\u306b\u306a\u308b\u4eba\u306a\u306e\u3067\u63a7\u3048\u3081\u306b)\u751f\u30ec\u30d0\u30fc\u713c\u304d\u306b\u725b\u30cf\u30c4\u304c\u304d\u307e\u3057\u305f\u3002\u30ec\u30d0\u30fc\u306f\u826f\u304f\u713c\u3044\u3066\u304f\u3060\u3055\u3044\u306d\u266a\u3068\u306e\u4e8b\u3002\u713c\u304d\u52a0\u6e1b\u306f\u81ea\u5df1\u8cac\u4efb\u3067\u3059\u304c\u3001\u805e\u304d\u5206\u3051\u306e\u826f\u3044\u79c1\u306f\u3057\u3063\u304b\u308a\u713c\u3044\u3066\u98df\u3079\u307e\u3057\u305f\u3088\u3001\u3067\u3082\u30ec\u30d0\u30fc\u306f\u30ec\u30d0\u81ed\u3055\u4e00\u5207\u7121\u3057\u3002\u725b\u30cf\u30c4\u3068\u5206\u304b\u3089\u306a\u3044\u4f4d\u7f8e\u5473\u3057\u304b\u3063\u305f\u3067\u3059\u3002\u65b0\u9bae\u306a\u306e\u306d\u3002\u3053\u3061\u3089\u306f\u3054\u307e\u6cb9\u3068\u751f\u59dc\u3067\u98df\u3079\u307e\u3059\u3002\u4f55\u304c\u597d\u304d\u3063\u3066\u30ec\u30d0\u3068\u30cf\u30c4\u304c\u4e00\u756a\u597d\u304d\u3002\u305d\u308c\u3060\u3051\u98df\u3079\u7d9a\u3051\u308c\u308b\u4f4d\u597d\u304d\u3067\u3059\u3002\u7d9a\u3044\u3066\u304a\u307e\u304b\u305b\uff15\u7a2e\u76db\u308a(\u725b)(\u901a\u5e38\uff11\uff17\uff18\uff10\u5186)\u306f\u7a2e\u985e\u3082\u30dc\u30ea\u30e5\u30fc\u30e0\u3082\u3042\u308b\u306e\u3067\u6e80\u8db3\u611f\u304c\u3042\u308a\u307e\u3059\u3002\u8ff7\u3063\u305f\u3089\u983c\u307f\u305f\u3044\uff11\u54c1\u3002(\u8d85\u30db\u30eb\u30e2\u30f3\u3001\u4e38\u3061\u3087\u3046\u3001\u30c8\u30ed\u30db\u30eb\u30e2\u30f3\u3001\u30e4\u30f3\u3001\u30ae\u30a2\u30e9)\u30e4\u30f3\u306f\u30b3\u30ea\u30b3\u30ea\u3001\u30b7\u30ed\u30ae\u30a2\u30e9\u306f\u3075\u308f\u3075\u308f\u3067\u7f8e\u5473\u3057\u304b\u3063\u305f\uff56\u3053\u3061\u3089\u306f\u5473\u564c\u6f2c\u3051\u3067\u4e0b\u5473\u3064\u304d\u3067\u3057\u305f\u3002\u305f\u307e\u308a\u91a4\u6cb9\u3067\u98df\u3079\u308b\u306e\u306f\u521d\u3081\u3066\u306a\u306e\u3067\u7f8e\u5473\u3057\u304b\u3063\u305f\u3067\u3059\u304c\u3001\u30db\u30eb\u30e2\u30f3\u304c\u4e0b\u5473\u3064\u304d\u306a\u306e\u3067\u7d50\u69cb\u3053\u3063\u3066\u308a\u306b\u306a\u3063\u3066\u3057\u307e\u3044\u307e\u3059\u3002\u91a4\u6cb9\u306a\u3089\u4e0b\u5473\u7121\u3057\u306e\u65b9\u304c\u79c1\u306f\u597d\u304d\u304b\u306a\u3002\u30cd\u30ae\u713c\u304d(\u767d\u30cd\u30ae\uff1f\u30db\u30af\u30db\u30af\u3057\u3066\u3066\u7f8e\u5473\u3057\u304b\u3063\u305f)\u30c8\u30e2\u30b5\u30f3\u30ab\u30af\u3068\u725b\u30cf\u30e9\u30df\u30bf\u30ec\u306e\u4e0b\u5473\u4ed8\u304d\u3002(\u3053\u306e\u6642\u70b9\u3067\u304a\u8179\u4e00\u676f\u3067\u3059)\u67d4\u3089\u304b\u304f\u3066\u7f8e\u5473\u3057\u3044\uff5e\u305d\u3057\u3066\u623f\u7dcf\u30e9\u30a4\u30b9\u3002\u30ad\u30e0\u30c1\u3001\u9ad8\u83dc\u3001\u30b6\u30fc\u30b5\u30a4\u306b\u5375\u3067\u7d61\u3081\u3066\u98df\u3079\u307e\u3059\u3002\u3053\u308c\u306f\u3006\u306b\u826f\u3055\u305d\u3046\u3088\u306d(\u30ac\u30c3\u30c4\u308a\u6d3e\u306e\u65b9\u306b)\u624b\u4f5c\u308a\u306e\u674f\u4ec1\u8c46\u8150\u306f\u5c11\u3057\u56fa\u3081\u306e\u30bf\u30a4\u30d7\u3067\u79c1\u597d\u307f\u3067\u3057\u305f\u3002\u7d50\u69cb\u98df\u3079\u305f\u3088\uff5e\u5f8c\u4f55\u6545\u304b\u30e2\u30d2\u30fc\u30c8\u3070\u304b\u308a\u98f2\u3093\u3067\u305f\u3002\u30db\u30eb\u30e2\u30f3\u304a\u8179\u4e00\u676f\u98df\u3079\u305f\u3044\u3068\u304d\u306b\u826f\u3044\u304a\u5e97\u304b\u3082\u3057\u308c\u307e\u305b\u3093\u3002\u5e97\u54e1\u3055\u3093\u3082\u30cf\u30ad\u30cf\u30ad\u3057\u3066\u3044\u308b\u611f\u3058\u3067\u826f\u3044\u611f\u3058\u3067\u3057\u305f\u3002\u5e30\u308a\u969b\u306b\u3082(\u305d\u3053\u305d\u3053\u9045\u3044\u6642\u9593\u5e2f\u3067\u3057\u305f\u304c)\u304a\u5ba2\u3055\u3093\u304c\u5165\u3063\u3066\u304d\u307e\u3057\u305f\u304c\u3053\u306e\u6642\u9593\u304b\u3089\u30db\u30eb\u30e2\u30f3\u306a\u3093\u3066\u51c4\u3044\u306a\u3041\uff5e", "3999", "3000", "\u591c", "4.0", "12", "10", "62"], ["\u6e0b\u8c37\u306e\u9053\u7384\u5742\u306b\u3042\u308b\u96a0\u308c\u5bb6\u7684\u306a\u30ea\u30fc\u30ba\u30ca\u30d6\u30eb\u306a\u30db\u30eb\u30e2\u30f3\u5c4b\u3055\u3093@\u623f\u7dcf\u30db\u30eb\u30e2\u30f3\u9053\u7384\u5742\u57fa\u5730\u5e97\uff5c\u30aa\u30e4\u30b8\u306e\u98df\u3079\u6b69\u304d\u65e5\u8a1