5\u3001\u91ce\u66ae\u7528\u304c\u3042\u308a\u30c0\uff5e\u30ea\u30f3\u30c3\u266a\u3068\u516b\u738b\u5b50\u3078\u203b\u308f\u305f\u3057\u306f\u65e5\u679d\u795e\u793e\u304b\u3089\uff01\u30c0\uff5e\u30ea\u30f3\u30c3\u266a\u3082\u51fa\u5148\u304b\u3089\u3060\u3063\u305f\u306e\u3067\u8eca\u306a\u308f\u3051\u3067\u98f2\u3081\u308b\u308f\u3051\u3067\uff5e\u30fe(\u2267\u25bd\u2266)\u30ce\u9ad8\u6821\u3001\u5927\u5b66\u6642\u4ee3\u306e\u5148\u8f29\u3001\u5f8c\u8f29\u304c\u3084\u305f\u3089\u591a\u3044\u516b\u738b\u5b50\u306a\u306e\u3067\u98df\u3079\u3066\u98f2\u3081\u308b\u304a\u5e97\u60c5\u5831\u306b\u306f\u307f\u3093\u306a\u7cbe\u901a\u3057\u3066\u3044\u308b\u306e\u3067\u3068\u3063\u3066\u304a\u304d\u306e\u672c\u5f53\u306f\u79d8\u5bc6\u60c5\u5831\uff01\uff1f\u306a\u304a\u5e97\u3092\u6559\u3048\u3066\u3082\u3089\u3063\u305f\u306e\u3067\u884c\u3063\u3066\u307f\u308b\u3053\u3068\u306b\u266a\u516b\u738b\u5b50\u5317\u53e3\u304b\u3089\u30c9\u30f3\u30ad\u3092\u76ee\u6307\u3057\u3001\u30c9\u30f3\u30ad\u524d\u306e\u4fe1\u53f7\u3092\u6e21\u308b\u524d\u306b\u56de\u308c\u5de6\u3059\u308b\u3060\u3051\uff01\u30a8\u30ec\u30d9\u30fc\u30bf\u30fc\u30678\u968e\u3078\u307e\u305a\u306f\u3068\u308a\u3042\u3048\u305a\u30d3\u30fc\u30eb\u3067\u304b\u3093\u3071\uff5e\u3044\u266a\u304a\u624b\u9803\u4fa1\u683c\u306e\u98f2\u307f\u653e\u984c\u4ed8\u304d\u306e\u30b3\u30fc\u30b9\u306b\u3057\u305f\u3082\u306e\u3060\u304b\u3089\u3001\u671f\u5f85\u306a\u3093\u3066\u3057\u306a\u3044\u3088\u306d\uff1f\u666e\u901a\u305d\u3046\u3060\u3088\u306d\uff1f\u305d\u3057\u305f\u3089\u3002\u3002\u3002\u3048\uff1f\u3048\uff1f\u3048\uff5e\uff5e\uff5e\uff5e\uff5e\uff5e\uff5e\uff5e\uff5e\uff5e\uff5e\uff5e\uff5e\uff1f\u3061\u3087\u3063\u3068\u5f85\u3063\u3066\uff5e\u306a\u3042\u306b\u3053\u308c\uff5e\uff1f\u3053\u3053\u3063\u3066\u5c45\u9152\u5c4b\u3060\u3088\u306d\uff1f\u3063\u3066\u4e00\u56de\u5916\u51fa\u3066\u78ba\u8a8d\u3057\u305f\u3044\u3068\u3053\u308d\u3060\u3063\u305f\u3051\u308c\u3069\u307e\u305f\u30c0\uff5e\u30ea\u30f3\u30c3\u266a\u306b\u6012\u3089\u308c\u308b\u304b\u3089\u6211\u6162\u3057\u3066\u6905\u5b50\u306b\u5ea7\u3063\u305f\u307e\u307e\u3067\u5927\u9a12\u304e(\u7b11)\u203b\u3082\u307f\u3058\u306b\u82b1\u7a42\u3058\u305d\u306b\u82b1\u3073\u3089\u3061\u3089\u3057\u3066\u308b\u3057\uff5e\u266a\u65e5\u672c\u6599\u7406\u306e\u304a\u5e97\u3058\u3083\u3042\uff5e\u306a\u3044\u3093\u3060\u3088\uff01\uff01\uff01(\u25ce_\u25ce;)\u8336\u7897\u84b8\u3057\u306b\u30db\u30bf\u30eb\u30a4\u30ab\u306e\u4e5d\u6761\u8471\u307f\u3042\u305e\u308c\u9162\u3044\u304f\u3089\u306b\u30ab\u30cb\u307e\u3067\u306e\u3063\u3066\u308b\u8336\u7897\u84b8\u3057\u306a\u3093\u3060\u3088\uff5e(@_@)\u307f\u305e\u308c\u306b\u4f7f\u3063\u3066\u308b\u5927\u6839\u3082\u3061\u3083\u3093\u3068\u304a\u5e97\u3067\u3059\u3063\u3066\u308b\u3082\u306e\u3060\u3057\uff01\uff01\uff01\uff01\u203b\u5473\u899a\u304c\u3044\u3044\u304b\u3089\u30d1\u30c3\u30af\uff1f\u306e\u3068\u304b\u4f5c\u308a\u304a\u304d\u3057\u3066\u6642\u9593\u306e\u7d4c\u3063\u305f\u3082\u306e\u306f\u308f\u304b\u308b\uff01\u6795\u5d0e\u7523\u3076\u3048\u3093\u9c39\u306e\u305f\u305f\u304d\u9e7f\u5150\u5cf6\u306e\u3076\u3048\u3093\u9c39\u306f\u81ed\u307f\u304c\u306a\u3044\u3057\u3053\u3053\u306e\u85ac\u5473\u91ce\u83dc\u306f\u65b0\u9bae\u3060\u3057\u5927\u6839\u8449\u3084\u304d\u3085\u3046\u308a\u306e\u98fe\u308a\u5207\u308a(\u30a2\u30c3\u30d7\u3067\u64ae\u3063\u3066\u304a\u3044\u305f\u306e\u306b\u307e\u305f\u9593\u9055\u3048\u3066\u753b\u50cf\u6d88\u3057\u3061\u3083\u3063\u305f)\u306f\u7279\u306b\u3059\u3070\u3089\u3057\u304f\u3001\u666e\u6bb5\u3042\u307e\u308a\u9c39\u306e\u305f\u305f\u304d\u3092\u98df\u3079\u306a\u3044\u308f\u305f\u3057\u304c\u611f\u52d5\u3057\u3066\u307b\u307c\u98df\u3079\u3061\u3083\u3063\u305f\u304f\u3089\u3044\uff5e(\u7b11)\u3053\u306e\u6642\u9c39\u306e\u305f\u305f\u304d\u306b\u5408\u308f\u305b\u3066\u65e5\u672c\u9152\u306b\u3057\u3066\u3044\u305f\u30c0\uff5e\u30ea\u30f3\u30c3\u266a\u306f\u30b9\u30cd\u30e2-\u30c9(\u7b11)\u3068\u3053\u308d\u304c\u306a\u3093\u3068\u3053\u306e\u5f8c\u3084\u3063\u3066\u304d\u305f\u3053\u308c\u307f\u3066\uff5e\uff5e\uff5e\uff5e\uff5e\uff5e\uff5e\uff5e\uff5e\uff5e\uff5e\uff5e\uff5e\u30fe(\u2267\u25bd\u2266)\u30ce\u4e8c\u4eba\u5206\u3067\u3053\u306e\u30dc\u30ea\u30e5\u30fc\u30e0\u3059\u3054\u3059\u304e\uff5e(((o(*\u309c\u25bd\u309c*)o)))\u30c0\u30fc\u30ea\u30f3\u3082\u65e5\u672c\u9152\u306b\u5408\u3046\u3082\u306e\u6765\u3066\u3088\u308d\u3053\u3093\u3067\u305f\uff08\u7b11\uff09\u30ab\u30cb\u306f\u305d\u306e\u307e\u307e\u3067\u3082\u3044\u305f\u3060\u3051\u308b\u3082\u306e\u3092\u4f7f\u7528\u3057\u3066\u3044\u308b\u3068\u304b\uff3c(\u25ceo\u25ce)\uff0f\u203b\u3053\u3061\u3089\u306b\u3082\u98df\u7528\u83ca\u306e\u82b1\u3073\u3089\u304c\u3042\u308a\u3001\u4f7f\u3044\u65b9\u306b\u3082\u95a2\u5fc3\u266a\u98df\u3079\u3084\u3059\u3044\u307b\u3050\u3057\u8eab\u3082\u3042\u3063\u3066\u3001\u30ab\u30cb\u306b\u5922\u4e2d\u306b\u306a\u308b\u3053\u3068\u3082\u306a\u3044\u306e\u3067\u98f2\u307f\u4f1a\u3001\u5408\u30b3\u30f3\u3001\u5fd8\u5e74\u4f1a\u306b\u3044\u3044\u304b\u3082\uff5e\uff01\uff01\uff01\uff01\uff01\uff01\uff01\u305d\u3057\u3066\u7d9a\u3044\u3066\u304d\u305f\u306e\u3053\u308c\u03b5=\u03b5=\u03b5=\u03b5=\u03b5=\u03b5=\u250c(;\u203e\u25c7\u203e)\u2518\u5a18\u547c\u3073\u51fa\u305d\u3046\u3068\u601d\u3063\u305f\u3051\u308c\u3069\u5317\u6d77\u9053\u65c5\u884c\u4e2d\u3060\u3063\u305f\u3057(T.T)\u304a\u3044\u3057\u3044\u306e\u306f\u3082\u3061\u308d\u3093\u3060\u3051\u308c\u3069\u3053\u306e\u5927\u304d\u3055\u306a\u306e\u306b\u7126\u3052\u305a\u306b\u304d\u308c\u3044\u306b\u706b\u304c\u901a\u3063\u3066\u3044\u305f\u3088\u266a\u203b\u7126\u3052\u3066\u3044\u305f\u308a\u3001\u706b\u304c\u901a\u3063\u3066\u3044\u306a\u304b\u3063\u305f\u308a\u3063\u3066\u3042\u308b\u3042\u308b\u3088\u306d(\u7b11)\u305d\u3057\u3066\u8d64\u6d77\u8001\u5c3e\u306e\u3066\u3093\u3077\u3089\u62b9\u8336\u5869\u3067\u3044\u305f\u3060\u304f\u3066\u3093\u3077\u3089\u306f\u8863\u306f\u30ab\u30ea\u3063\u3068\u8eab\u306f\u307b\u308d\u3063\u3068\u3057\u3066\u3044\u3066\u3053\u308c\u307e\u305f\u30b0\uff5e\u30fe(\u2267\u25bd\u2266)\u30ce\u5e06\u7acb\u306e\u5357\u86ee\u4ed5\u7acb\u3066\u3082\u3046\u306d\u3001\u9065\u6614\u306e\u7d50\u7d0d\u5f8c\u306e\u304a\u98df\u4e8b\u3044\u305f\u3060\u3044\u305f\u304a\u5e97\u3088\u308a\u3053\u3053\u306e\u307b\u3046\u304c\u3059\u3054\u3044\u3068\u601d\u3063\u305f\u3088(~_~\u30e1)\u3053\u308c\u307e\u305f\u306a\u306b\uff1f\uff1f\uff1f\u7518\u9162\u304c\u305f\u307e\u3089\u306a\u304f\u304a\u3044\u3057\u304f\u3066\u30da\u30ed\u3063\u3068\u98df\u3079\u3061\u3083\u3063\u305f\u30fe(\u2267\u25bd\u2266)\u30ce\u3053\u3060\u308f\u308a\u306e\u8336\u305d\u3070\u672c\u308f\u3055\u3073\u3060\u3057(@_@)\u98df\u6750\u306b\u3053\u3093\u306a\u306b\u304a\u91d1\u304b\u3051\u3066\u7d4c\u55b6\u5927\u4e08\u592b\uff1f\u306a\u306e\u304b\u5fc3\u914d\u306b\u306a\u308b\u30ec\u30d9\u30eb\u3067\u3057\u3087\u3046(\u25ce_\u25ce;)\u5f69\u679c\u5b9f\u306e\u7518\u5473\u6843\u306e\u9326\u7389\u7fb9\u306b\u3076\u3069\u3046\u9326\u7389\u7fb9\u3082\u624b\u4f5c\u308a\u3088\u306d\uff3c(\u25ceo\u25ce)\uff0f\u3076\u3069\u3046\u3082\u307f\u3066\u3053\u308c\u2193\u6700\u521d\u304b\u3089\u6700\u5f8c\u307e\u3067\u7d20\u6674\u3089\u3057\u3059\u304e\u3066\u4eba\u751f\u3067\u4e00\u756a\u30d3\u30c3\u30af\u30ea\u3057\u305f\u304f\u3089\u3044\u7d20\u6674\u3089\u3057\u304a\u98df\u4e8b\u3067\u3057\u305f\uff01\u306d\u3001\u3082\u3046\u4e00\u56de\u78ba\u8a8d\u3059\u308b\u3051\u3069\u3053\u3053\u3063\u3066\u5c45\u9152\u5c4b\u3055\u3093\u306a\u306e\u3088\u306d\uff1f\uff1f\uff1f\uff1f\uff1f\uff1f\uff1f\uff1f\u65e5\u672c\u6599\u7406\u5c4b\u3055\u3093\u3067\u6599\u7406\u4eba\u306e\u65b9\u304c\u6570\u4eba\u3044\u308b\u304a\u5e97\u3067\u3082\u3053\u3053\u307e\u3067\u306f\u30fb\u30fb\u30fb\u3063\u3066\u304f\u3089\u3044\u306a\u7d4c\u9a13\u591a\u6570\u3042\u308b\u306e\u306b\u3053\u3053\u3063\u3066\u4e00\u4f53\u3069\u3046\u306a\u3063\u3066\u308b\u306e\uff1f\uff1f\uff1f\uff1f\u3063\u3066\u304b\u3001\u3053\u3093\u30