6\u826f\u597d\uff01\uff01(#^.^#)\u3069\u308c\u3082\u7f8e\u5473\u3057\u3044\u306e\u3067\u3059\u304c\u5168\u4f53\u7684\u306b\u30b5\u30c3\u30d1\u30ea\u306a\u306e\u3067\u3001\u305d\u308d\u305d\u308d\u30ab\u30ed\u30ea\u30fc\u304c\u6b32\u3057\u304f\u306a\u3063\u3066\u304d\u307e\u3059\uff01\uff08\u7b11\uff09\u3010\u304a\u3000\u934b\u3011\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u306e\u305b\u3044\u308d\u84b8\u3057\u934b\u3000 \uff5e\u6700\u9ad8\u7d1a\u5730\u9d8f\u3092\u3075\u3093\u3060\u3093\u306b\uff5e\u3077\u308a\u3093\u3077\u308a\u3093\u306e\u9d8f\u3082\u3082\u8089\uff01\uff01\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u3060\u3051\u3042\u3063\u3066\u3001\u5f3e\u529b\u3001\u6b6f\u3054\u305f\u3048\u304c\u3042\u308a\u3001\u304a\u8089\u306e\u65e8\u5473\u304c\u30ae\u30e5\u3063\u3068\u8a70\u307e\u3063\u3066\u3044\u308b\u5370\u8c61\u3067\u3059\u266a\u30ab\u30dc\u30c1\u30e3\u304c\u3068\u3063\u3066\u3082\u7518\u307f\u304c\u3042\u308a\u307e\u3057\u305f(*\uff89\u03c9\uff89)\u2606\u3010\u63da\u3052\u7269\u3011\u82e5\u9d8f\u306e\u5510\u63da\u3052\u6cb9\u30e2\u30ce\u304d\u305f\u30fc\u30fc\u30fc\uff01\uff01(*\uff89\u03c9\uff89)\uff08\u7b11\uff09\u9ad8\u30ab\u30ed\u30ea\u30fc\u30e1\u30cb\u30e5\u30fc\u5927\u597d\u304d\u306a\u306e\u3067\u3001\u5b09\u3057\u3044\uff01\uff01\uff08\u7b11\uff09\u30dc\u30ea\u30e5\u30fc\u30e0\u3082\u3042\u308a\u3001\u8089\u6c41\u305f\u3063\u3077\u308a\u306e\u63da\u3052\u7acb\u3066\u30a2\u30c4\u30a2\u30c4\u3067\u7f8e\u5473\u3057\u304b\u3063\u305f\u3067\u3059(*\uff89\u03c9\uff89)\u3010\u304a\u98df\u4e8b\u3011\u7df4\u308a\u3053\u307f\u8336\u305d\u3070 \uff5e\u826f\u8cea\u306e\u62b9\u8336\u3092\u7df4\u308a\u3053\u3093\u3060\u9999\u308a\u9ad8\u3044\u9038\u54c1 \uff5e\u304a\u8336\u306e\u98a8\u5473\u304c\u3042\u308b\u8336\u305d\u3070\u3002\u5c45\u9152\u5c4b\u3055\u3093\u3068\u3057\u3066\u306f\u7f8e\u5473\u3057\u3044\u3067\u3059\u306d\uff01(#^.^#)\u3082\u3046\u5c11\u3057\u30b3\u30b7\u304c\u3042\u308b\u307b\u3046\u304c\u597d\u307f\u3067\u3059\u266a\u3053\u308c\u304b\u3089\u306e\u6691\u3044\u6642\u671f\u3001\u3006\u30bd\u30d0\u826f\u3044\u3067\u3059\u306d\uff01\u3010\u7518\u3000\u5473\u3011\u672c\u65e5\u306e\u30c7\u30b6\u30fc\u30c8\u308f\u3089\u3073\u9905\u3067\u3057\u305f\u3063\u2606\u3082\u3061\u3082\u3061\u3067\u7f8e\u5473\u3057\u3044(*\uff89\u03c9\uff89)\u30c7\u30b6\u30fc\u30c8\u3082\u548c\u3092\u5fb9\u5e95\u3057\u3066\u3044\u308b\u306e\u3067\u3059\u306d\u266a\u7f8e\u5473\u3057\u304b\u3063\u305f\u306e\u3067\u3001\u30ef\u30ac\u30de\u30de\u8a00\u3063\u3066\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u306e\u897f\u4eac\u5473\u564c\u713c\u304d\u3092\u8ffd\u52a0\u30aa\u30fc\u30c0\u30fc\u3057\u3061\u3083\u3044\u307e\u3057\u305f(*\uff89\u03c9\uff89)\u304a\u5473\u564c\u306e\u7518\u307f\u306f\u3001\u9d8f\u8089\u306b\u3082\u3088\u304f\u5408\u3044\u307e\u3059\u306d\u266a\u5869\u6c17\u3082\u307b\u3069\u3088\u304f\u3001\u304a\u9152\u306b\u30d4\u30c3\u30bf\u30ea\u3067\u3057\u305f\uff01\uff01(\u2267\u25bd\u2266)\u6253\u3061\u5408\u308f\u305b\u3082\u3046\u307e\u304f\u3044\u3063\u3066\u3054\u6a5f\u5acc\u306e\u307e\u307e\u5e30\u5b85\u3067\u3059\uff5e\u266a(*\uff89\u03c9\uff89)\u3054\u3061\u305d\u3046\u3055\u307e\u3067\u3057\u305f\u266a      ", "3999", "3000", "\u591c", "3.6", "330", "306", "26"], ["\u6075\u6bd4\u5bff\u897f\u53e3\u3059\u3050\uff01\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u3092\u55b0\u3089\u304a\u3046\uff01\uff01", "        \u6075\u6bd4\u5bff\u3067\u98f2\u3080\u6a5f\u4f1a\u3063\u3066\u672c\u5f53\u306b\u591a\u3044\u3093\u3067\u3059\u3088\u306d\u3002\u305d\u306e\u90fd\u5ea6\u304a\u5e97\u9078\u3073\u3063\u3066\u8ff7\u3046\u3093\u3067\u3059\u304c\u4eca\u56de\u306f\u304a\u53cb\u9054\u304c\u30c1\u30e7\u30a4\u30b9\u3057\u305f\u99c5\u8fd1\u306e\u3053\u3061\u3089\u3078\u3002JR\u897f\u53e3\u51fa\u3066\u30a2\u30c8\u30ec\u897f\u9928\u76f4\u3050\u76ee\u306e\u524d\u306e\u30d3\u30eb\uff14\u968e\u3067\u3059\u3002\u304a\u5e97\u306f\u3001\u548c\u30e2\u30c0\u30f3\uff01\u500b\u5ba4\u3092\u5229\u7528\u3057\u307e\u3057\u305f\u304c\u30a2\u30af\u30a2\u30ea\