4\u69fd\u306b\u8fd1\u3065\u304f\u3068\u304a\u96a3\u306e\u304a\u3058\u3055\u307e\u3068\u76ee\u304c\u5408\u3046\u306e\u3067\u5199\u771f\u64ae\u308c\u305a\u3002\u6b8b\u5ff5\u3002\u7b11\u3053\u3093\u306a\u306b\u5e83\u3044\u304a\u90e8\u5c4b\u3092\u4e8c\u4eba\u3067\u4f7f\u308f\u305b\u3066\u3082\u3089\u3048\u308b\u8d05\u6ca2\u3002\u3000\uff08*\u00b4\u30a7`*\uff09\u65e9\u3081\u306b\u4e88\u7d04\u3057\u3066\u304a\u3044\u3066\u3088\u304b\u3063\u305f\u266a\u3010\u30b6\u30fb\u30e2\u30eb\u30c4\u3011\u901a\u5e38\u306e\u98f2\u307f\u653e\u984c\u306a\u3089\u91d1\u9ea6\u306e\u30d3\u30fc\u30eb\u304c\u3001\u30d7\u30ec\u30df\u30a2\u30e0\u98f2\u307f\u653e\u984c\u306a\u3089\u30e2\u30eb\u30c4\u304c\u3069\u30fc\u3093\u3002\u30d7\u30ec\u30df\u30a2\u30e0\u98f2\u307f\u653e\u984c\u30d0\u30f3\u30b6\u30a4\u3002\u3000\u30fd\uff08\u00b4\u25bd\uff40\uff09/\uff5e\u266a\u3010\u304a\u901a\u3057\u3000\uff1a\u3000\u677e\u8338\u3068\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u306e\u5375\u8c46\u8150\uff5e\u306a\u3081\u3089\u304b\u306a\u820c\u89e6\u308a\uff5e\u3011\u3010\u524d\u83dc\u3000\uff1a\u3000\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u306e\u9d8f\u76ae\u30dd\u30f3\u9162\uff5e\u5730\u9d8f\u306e\u8d05\u6ca2\u306a\u5473\u308f\u3044\uff5e\u3011\u3010\u524d\u83dc\u3000\uff1a\u3000\u30d6\u30e9\u30f3\u30c9\u5408\u9d28\u3068\u5927\u6839\u306e\u6885\u548c\u3048\uff5e\u8c4a\u5bcc\u306a\u6804\u990a\u7d20\u3067\u65e8\u307f\u304c\u8a70\u307e\u3063\u305f\u7d05\u8336\u9d28\uff5e\u3011\u3053\u306e3\u54c1\u306e\u4e2d\u3067\u3001\u8336\u7897\u84b8\u3057Lover\u306e\u79c1\u306e\u597d\u307f\u306f\u7d76\u5bfe\u5375\u8c46\u8150\u3060\u3068\u601d\u3063\u305f\u306e\u306b\u3001\u3086\u305a\u76ae\u306e\u4e57\u3063\u305f\u9d8f\u76ae\u30dd\u30f3\u9162\u304c\u304a\u3044\u3057\u304b\u3063\u305f\u266a\u8102\u3063\u307d\u304f\u306a\u308a\u304c\u3061\u306a\u9d8f\u76ae\u304c\u3001\u51b7\u83dc\u3067\u3082\u7f8e\u5473\u3057\u3044\u3063\u3066\u30b9\u30c6\u30ad\u3002\u3010\u9152\u80b4\u3000\uff1a\u3000\u9999\u3070\u3057\u7099\u308a\u679d\u8c46\uff5e\u3053\u3060\u308f\u308a\u306e\u5869\u3067\uff5e\u3011\u30da\u30da\u30ed\u30f3\u30c1\u30fc\u30ce\u7684\u306b\u6cb9\u3067\u7092\u3081\u3089\u308c\u305f\u679d\u8c46\u306f\u30d3\u30fc\u30eb\u304c\u30b9\u30b9\u30e0\u5473\u308f\u3044\u3002\u6307\u304c\u6cb9\u3067\u30d9\u30c3\u30bf\u30d9\u30bf\u306b\u306a\u3063\u3066\u3082\u98df\u3079\u305f\u304f\u306a\u308b\u3002\u3000\uff08*\u00b4\u8278\uff40\uff09\u3010\u523a\u8eab\u3000\uff1a\u3000\u6795\u5d0e\u7523\u3076\u3048\u3093\u9c39\u306e\u305f\u305f\u304d\uff5e\u9e7f\u5150\u5cf6\u770c\u304b\u3089\u304a\u5c4a\u3051\uff5e\u3011\u4eca\u5e74\u306f\u65e9\u304f\u3082\u521d\u9c39\u3092\u98df\u3079\u3066\u3057\u307e\u3063\u305f\u3068\u3044\u3046\u3053\u3068\u304b\uff01\u5b63\u7bc0\u5148\u53d6\u308a\u266a\u3000(\uff4f'\u2200'\u4eba)\u3010\u304a\u934b\u3000\uff1a\u3000\u3055\u3055\u307f\u4ed8\u304d\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u306e\u305b\u3044\u308d\u84b8\u3057\u934b\u3000\uff5e\u6700\u9ad8\u7d1a\u5730\u9d8f\u3092\u3075\u3093\u3060\u3093\u306b\uff5e\u3011\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u306e\u3044\u308d\u3093\u306a\u90e8\u4f4d\u304c\u3066\u3093\u3053\u76db\u308a\u306e\u84b8\u7c60\u767b\u5834\u3002\u6700\u9ad8\u7d1a\u5730\u9d8f\u304c\u591a\u3044\u306e\u3082\u5b09\u3057\u3044\u3051\u3069\u3001\u304a\u91ce\u83dc\u304c\u305f\u3063\u3077\u308a\u306a\u306e\u3082\u5b09\u3057\u3044\u266a\u85ac\u5473\u3068\u3064\u3051\u3060\u308c\u3092\u30b9\u30bf\u30f3\u30d0\u30a4\u3057\u3066\u30ef\u30af\u30ef\u30af\u3057\u3070\u3057\u5f85\u3064\u306e\u56f3\u3002\u3000o\uff08^\u25bd^\uff09o\u30b7\u30e5\u30f3\u30b7\u30e5\u30f3\u6e6f\u6c17\u304c\u51fa\u3066\u304d\u305f\u3089\u3001\u3042\u3068\u5c11\u3057\u3042\u3068\u5c11\u3057\u3002\u51fa\u6765\u4e0a\u304c\u308a\uff5e\u266a\u3000\u30fd\uff08\u00b4\u25bd\uff40\uff09/\uff5e\u266a\u30aa\u30b5\u30d9\u30ea\u306b\u5922\u4e2d\u306b\u306a\u3063\u3066\u3044\u305f\u304b\u3089\u3001\u3061\u3087\u3063\u3068\u6642\u9593\u304b\u3051\u3059\u304e\u305f\u304b\uff01\uff1f\u3000\u30ce)\u309c\u0414\u309c(\u30fd\u3063\u3066\u5fc3\u914d\u306b\u306a\u3063\u305f\u3051\u3069\u3001\u305d\u3093\u306a\u5fc3\u914d\u306f\u3054\u7121\u7528\u306a\u304f\u3089\u3044\u3001\u529b\u5f37\u3044\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u3055\u307e\u3002\u3058\u3085\u30fc\u3059\u3043\uff5e\u3067\u3080\u304e\u3085\u3080\u304e\u3085\u3063\u3068\u529b\u5f37\u3044\u8089\u8cea\u306f\u3001\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u306a\u3089\u3067\u306f\u3002\u84b8\u3057\u3066\u8102\u304c\u843d\u3068\u3055\u308c\u3066\u3082\u305d\u306e\u30b8\u30e5\u30fc\u30b7\u30fc\u3055\u306f\u8870\u3048\u305a\u3002\u6050\u308b\u3079\u3057\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u3055\u307e\uff01\u3000\uff08*\u309cO\u309c*\uff09\u3010\u828b\u713c\u914e\u3000\u9ed2\u4e38\u3011\u84b8\u3057\u934b\u306e\u304a\u4f9b\u306b\u828b\u713c\u914e\u3002\u3010\u63da\u3052\u7269\u3000\uff1a\u3000\u672c\u5834\u624b\u7fbd\u5148\u306e\u5c3e\u5f35\u63da\u3052\uff5e\u3084\u307f\u3064\u304d\u306b\u306a\u308b\u4e00\u54c1\uff5e\u3011\u5f85\u3063\u3066\u307e\u3057\u305f\u306e\u624b\u7fbd\u5148\u266a\u76ae\u30d1\u30ea\u3001\u4e2d\u30e0\u30ae\u30e5\u30e0\u30ae\u30e5\u3063\uff01\u624b\u7fbd\u5148\u3092\u30d1\u30af\u3063\u3068\u54a5\u3048\u3066\u9aa8\u3060\u3051\u51fa\u3059\u3001\u3042\u306e\u540d\u53e4\u5c4b\u624b\u7fbd\u5148\u3092\u98df\u3079\u308b\u304a\u7d04\u675f\u306e\u304a\u4f5c\u6cd5\uff1f\u3082\u901a\u7528\u3057\u306a\u3044\u304f\u3089\u3044\u3001\u5927\u304d\u3055\u306f\u3082\u3061\u308d\u3093\u3001\u9aa8\u307e\u3067\u30ae\u30e5\u3063\u3068\u7de0\u307e\u3063\u305f\u8089\u8cea\u306f\u3001\u4e21\u624b\u3065\u304b\u307f\u3067\u771f\u3093\u4e2d\u304b\u3089\u30ac\u30d6\u30ea\u3068\u8c6a\u5feb\u306b\u304b\u3076\u308a\u3064\u304f\u306e\u304c\u4e00\u756a\u3002\u3000\uff3e\uff3e\u4f55\u6c17\u306b\u3001\u6dfb\u3048\u3089\u308c\u305f\u5927\u304d\u306a\u30b7\u30b7\u30c8\u30a6\u304c\u30a6\u30de\u30b7\uff01\u3010\u7389\u4e43\u5149\u3000\u7d14\u7c73\u541f\u91b8\u3000\u9152\u697d\u3011\u529b\u5f37\u304f\u30b8\u30e5\u30fc\u30b7\u30fc\u306a\u624b\u7fbd\u5148\u306b\u306f\u3001\u30ad\u30ea\u3063\u3068\u3057\u305f\u5473\u308f\u3044\u306e\u7aef\u9e97\u8f9b\u53e3\u3002\u3010\u5275\u4f5c\u3000\uff1a\u3000\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u306e\u897f\u4eac\u5473\u564c\u713c\u304d\uff5e\u5730\u9d8f\u306e\u5473\u308f\u3044\u3092\u304a\u6109\u3057\u307f\u4e0b\u3055\u3044\uff5e\u3011\u897f\u4eac\u5473\u564c\u3067\u3057\u3063\u304b\u308a\u3057\u305f\u5473\u306e\u3064\u3051\u3089\u308c\u305f\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u304c\u30c1\u30ad\u30f3\u30b9\u30c6\u30fc\u30ad\u4e26\u307f\u306e\u8089\u539a\u3055\u30c7\u30ab\u30b5\u3067\u767b\u5834\u3002\u5199\u771f\u3067\u306f\u308f\u304b\u308a\u3065\u3089\u3044\u3057\u3001\u8304\u5b50\u3082\u30c7\u30ab\u30a4\u3057\u3067\u4f1d\u308f\u308a\u3065\u3089\u3044\u3067\u3059\u304c\u3001\u3053\u308c1\u3064\u30921/4\u30ab\u30c3\u30c8\u3057\u3066\u3084\u3063\u3068\u3072\u3068\u53e3\u3067\u3061\u3087\u3046\u3069\u3044\u3044\u304f\u3089\u3044\u306e\u5927\u304d\u3055\u3067\u3059\u3002\u897f\u4eac\u5473\u564c\u597d\u304d\u3063\u3066\u3053\u3068\u3082\u3042\u308a\u307e\u3059\u304c\u3001\u3053\u306e\u304a\u6599\u7406\u304c\u4e00\u756a\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u306e\u529b\u5f37\u3044\u8089\u8cea\u3068\u5473\u564c\u306b\u8ca0\u3051\u306a\u3044\u91ce\u8da3\u3042\u3075\u308c\u308b\u5473\u308f\u3044\u3092\u582a\u80fd\u3067\u304d\u305f\u3068\u601d\u3044\u307e\u3059\u3002\u304b\u306a\u308a\u30c7\u30ab\u304f\u3066\u8089\u8cea\u5f37\u304f\u3066\u30a2\u30b4\u75b2\u308c\u305f\u3051\u3069\u3002\u7b11\u3010\u304a\u98df\u4e8b\u3000\uff1a\u3000\u7df4\u308a\u3053\u307f\u8336\u305d\u3070\uff5e\u826f\u8cea\u306e\u62b9\u8336\u3092\u7df4\u308a\u3053\u3093\u3060\u9999\u308a\u9ad8\u3044\u9038\u54c1\uff5e\u3011\u304a\u98df\u4e8b\u306f\u30c4\u30e4\u30c3\u30c4\u30e4\u306e\u8336\u305d\u3070\u3002\u3066\u3063\u304d\u308a\u304a\u98df\u4e8b\u3082\u9d8f\u6599\u7406\u304b\u3068\u601d\u3063\u3066\u3044\u305f\u306e\u3067\u3061\u3087\u3063\u3068\u9a5a\u304d\u3002\u3067\u3082\u