8b\u4e00\u76bf\u306b\u306a\u3063\u3066\u3044\u307e\u3059\u3002\u56db\u4e07\u5341\u3000\u7d14\u7c73\u541f\u91b8\u523a\u8eab\u3000\u304b\u3064\u304a\u3001\u307e\u3050\u308d\u3001\u9bdb\u3002\u9bdb\u306b\u306f\u30ec\u30e2\u30f3\u306e\u8584\u5207\u308a\u304c\u631f\u3093\u3067\u3042\u308a\u3055\u308f\u3084\u304b\u306a\u98a8\u5473\u304c\u79fb\u3063\u3066\u3044\u307e\u3059\u3002\u63da\u3052\u7269\u3000\u672c\u5834\u624b\u7fbd\u306e\u5c3e\u5f35\u63da\u3052 \u62b9\u8336\u5869 \u4e07\u9858\u5bfa\u5510\u8f9b\u5b50\u7518\u8f9b\u306e\u624b\u7fbd\u5148\u306f\u597d\u307f\u306e\u304a\u5473\u3002\u6dfb\u3048\u3089\u308c\u305f2\u8272\u306e\u4e07\u9858\u5bfa\u5510\u8f9b\u5b50\u306f\u3068\u3066\u3082\u6c34\u3005\u3057\u304f\u3066\u63da\u3052\u7269\u3092\u30ea\u30bb\u30c3\u30c8\u3002\u304a\u934b\u3000\u30b5\u30b5\u30df\u4ed8\u304d\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u306e\u305b\u3044\u308d\u84b8\u3057\u30e2\u30e2\u3092\u4e2d\u5fc3\u3068\u3057\u305f\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u3068\u767d\u83dc\u3001\u3057\u3081\u3058\u3001\u6c34\u83dc\u3001\u9577\u30cd\u30ae\u3002\u7d05\u8449\u9ea9\u304c\u79cb\u306e\u5f69\u308a\u3092\u6dfb\u3048\u3066\u3044\u307e\u3059\u3002\u30dd\u30f3\u9162\u3067\u9802\u304d\u307e\u3057\u305f\u3002\u5275\u4f5c\u3000\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u306e\u897f\u4eac\u5473\u564c\u713c\u304d\u7518\u3081\u306e\u897f\u4eac\u5473\u564c\u3092\u4e0a\u9762\u306b\u5857\u3063\u3066\u713c\u304d\u4e0a\u3052\u3066\u3042\u308b\u70ba\u3001\u8089\u306b\u67d3\u307f\u8fbc\u3093\u3060\u897f\u4eac\u5473\u564c\u306b\u9999\u3070\u3057\u3055\u304c\u30d7\u30e9\u30b9\u3055\u308c\u3066\u3044\u307e\u3059\u3002\u3059\u3060\u3061\u30cf\u30a4\u30dc\u30fc\u30eb\u63da\u3052\u7269\u3000\u672c\u683c\u30c1\u30ad\u30f3\u5357\u86ee\u3000\u30bf\u30eb\u30bf\u30eb\u30bd\u30fc\u30b9\u3068\u304b\u3089\u3081\u3066\u304a\u98df\u4e8b\u3000\u7df4\u308a\u8fbc\u307f\u8336\u305d\u3070\u62b9\u8336\u304c\u7df4\u308a\u3053\u307e\u308c\u305f\u304a\u854e\u9ea6\u3002\u6700\u5f8c\u306e\u3006\u306b\u3072\u3093\u3084\u308a\u3064\u308b\u308a\u3068\u9802\u304d\u307e\u3059\u3002\u7518\u5473\u3000\u6843\u306e\u9326\u7389\u7fb9\u6843\u306e\u9326\u7389\u7fb9\u306b\u67ff\u304c\u6dfb\u3048\u3089\u308c\u3066\u3044\u307e\u3059\u3002\u9326\u7389\u7fb9\u306e\u512a\u3057\u3044\u30aa\u30ec\u30f3\u30b8\u3068\u67ff\u306e\u6fc3\u3044\u30aa\u30ec\u30f3\u30b8\u304c\u7dba\u9e97\u306a\u8272\u306e\u7d44\u307f\u5408\u308f\u305b\u3002\u3060\u3093\u3060\u3093\u5bd2\u304f\u306a\u3063\u3066\u304f\u308b\u3068\u304a\u934b\u306b\u3044\u304d\u304c\u3061\u3067\u3057\u305f\u304c\u3001\u84b8\u3057\u6599\u7406\u3067\u30d8\u30eb\u30b7\u30fc\u306b\u9802\u304f\u306e\u3082\u3044\u3044\u3067\u3059\u306d\u3002", "5999", "5000", "\u591c", "3.5", "696", "246", "124"], ["\u6075\u6bd4\u5bff\u99c5\u304b\u3089\u30b9\u30b0\u2661\u30ea\u30fc\u30ba\u30ca\u30d6\u30eb\u306b\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u3092\u6e80\u55ab\u3067\u304d\u308b\u304a\u5e97\u2661\uff5c\u3071\u3093\u3060\u306e\u3076\u308d\u3050\uff5e\u6bce\u65e5\u304c\u30d7\u30ec\u30bc\u30f3\u30c8\uff5e", "        \u6075\u6bd4\u5bff\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u3068\u305f\u3063\u3077\u308a\u5b63\u7bc0\u91ce\u83dc\u3000\u5730\u9d8f\u5c0f\u753a\u6075\u6bd4\u5bff\u5e97\uff08\u30b8\u30c9\u30ea\u30b3\u30de\u30c1\uff09\u306b\u4f3a\u3044\u307e\u3057\u305f\u30fc\u3002\u5730\u4e0b\u9244\u65e5\u6bd4\u8c37\u7dda\u6075\u6bd4\u5bff\u99c53\u756a\u51fa\u53e3\u5f92\u6b691\u5206\u3002\u6075\u6bd4\u5bff\u99c5\u524d\u3067\u30a2\u30af\u30bb\u30b9\u306e\u826f\u3044\u30d3\u30eb\u306e4\u968e\u306b\u5927\u4eba\u306e\u4e0a\u8cea\u5e83\u3005\u500b\u5ba4\u7a7a\u9593\u3002\u30a8\u30ec\u30d9\u30fc\u30bf\u30fc\u30674\u968e\u306b\u3042\u304c\u308b\u3068\u3001\u548c\u306e\u4f47\u307e\u3044\u306b\u8fce\u3048\u3089\u308c\u307e\u3059\u3002\u5165\u308b\u3068\u737a\u796d\u7b49\u3001\u8a71\u984c\u306e\u65e5\u672c\u9152\u304c\u30ba\u30e9\u30ea\u3002\u7f8e\u5473\u3057\u3044\u548c\u98df\u306b\u65e5\u672c\u9152\u3002\u548c\u304c\u6e80\u55ab\u51fa\u6765\u305d\u3046\u306a\u30ef\u30af\u30ef\u30af\u611f\u3092\u611f\u3058\u3066\u30fc\u30fc\u30fc\u3002\u548c\u98df\u304c\u597d\u304d!!\u9d8f\u304c\u597d\u304d!!\u304a\u91ce\u83dc\u304c\u597d\u304d!!\u305d\u3093\u306a\u79c1\u304c\u7652\u3057\u306b\u9078\u3093\u3060\u304a\u5e97\u3002\u3061\u3087\u3063\u3068\u307b\u3093\u308f\u304b\u548c\u307f\u307e\u3059\u3002\u3061\u306a\u307f\u306b\u3053\u3061\u3089\u306e\u304a\u5e97\u306f3\u6642\u9593999\u5186\u306e\u98f2\u307f\u653e\u984c\u3082\u3042\u308b\u30ea\u30fc\u30ba\u30ca\u30d6\u30eb\u306b\u3057\u3066\u7f8e\u5473\u3057\u3044\u304a\u5e97\u3002\u672c\u65e5\u5229\u7528\u3092\u3055\u305b\u3066\u9802\u3044\u305f\u304a\u90e8\u5c4b\u306f\u548c\u30e2\u30c0\u30f3\u306a\u7d20\u6575\u7a7a\u9593\u3002\u500b\u5ba4\u306b\u5165\u308b\u3068\u601d\u3063\u3066\u305f\u3088\u308a\u3082\u30b9\u30bf\u30a4\u30ea\u30c3\u30b7\u30e5!!\u3044\u305a\u308c\u306e\u5e2d\u306b\u3082\u304a\u9b5a\u304c\u6cf3\u3044\u3067\u3044\u3066\u3001\u5fc3\u306b\u6e05\u6dbc\u611f\u3092\u4e0e\u3048\u3066\u304f\u308c\u307e\u3059\u3002\u300c\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u30d7\u30e9\u30c1\u30ca\u30b3\u30fc\u30b9\u300d\u3092\u4e88\u7d04\u3057\u3066\u53c2\u308a\u307e\u3057\u305f\u30023H\u98f2\u307f\u653e\u984c\u25a0\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u5c3d\u304f\u3057\u30d7\u30e9\u30f3\u767d\u91d1\u30b3\u30fc\u30b9\u25a010\u54c15,000\u5186\u306a\u3093\u3068\u3002\u30d7\u30ec\u30df\u30a2\u30e0\u98f2\u307f\u653e\u984c\uff08\u7d04100\u7a2e\u985e\uff09\u4ed8\u304d\u3067\u306e\u304a\u5024\u6bb5\u3067\u3059\u3088\u3002\u3053\u308c\u306b\u306f\u3073\u3063\u304f\u308a\u30ea\u30fc\u30ba\u30ca\u30d6\u30eb!!\u30ab\u30eb\u30d4\u30b9\u30b5\u30ef\u30fc\u3067\u30ab\u30f3\u30d1\u30a4\u3057\u3066\u3001\u7a0b\u306a\u304f\u3057\u3066\u304a\u901a\u30573\u70b9\u76db\u308a\u304c\u624b\u969b\u3088\u304f\u904b\u3070\u308c\u3066\u6765\u307e\u3057\u305f\u3002\u3010\u304a\u901a\u3057\u3011\u677e\u8338\u3068\u540d\u53e4\u5c4b\u30b3\u30fc\u30c1\u30f3\u306e\u5375\u8c46\u8150\uff5e\u306a\u3081\u3089\u304b