089\u3057\u83dc\u3001\u30db\u30fc\u30b9\u30e9\u30c7\u30a3\u30c3\u30b7\u30e5\u3002\u30ec\u30d5\u30a9\u30fc\u30eb\u98a8\u5473\u306e\u30af\u30ea\u30fc\u30e0\u306f\u3075\u308f\u3063\u3068\u512a\u3057\u3044\u5473\u3002\u30aa\u30de\u30fc\u30eb\u30a8\u30d3\u306f\u30ec\u30a2\u306a\u706b\u5165\u308c\u3002\u4e0a\u54c1\u306a\u307e\u3068\u307e\u308a\u3002\u25cb\u81ea\u5bb6\u88fd\u30d1\u30f32\u7a2e\u985e\u3000\u2605\u30ec\u30c8\u30ce\u3067\u3044\u305f\u3060\u3044\u305f\u30d5\u30a9\u30ab\u30c3\u30c1\u30e3\u304c\u3068\u3066\u3082\u7f8e\u5473\u3057\u304b\u3063\u305f\u8a18\u61b6\u304c\u3042\u308b\u306e\u3060\u3051\u3069\u3053\u3061\u3089\u306e\u81ea\u5bb6\u88fd\u3060\u3068\u3044\u3046\u30d1\u30f3\u3082\u304b\u306a\u308a\u306e\u7f8e\u5473\u3057\u3055\u3002\u7c89\u306e\u98a8\u5473\u3001\u98df\u611f\u3001\u5f15\u304d\u5177\u5408\u3001\u7518\u307f\u3001\u9999\u308a\u3002\u5168\u3066\u304c\u30d0\u30e9\u30f3\u30b9\u3088\u304f\u3063\u3066\u3001\u30b3\u30fc\u30b9\u3067\u767b\u5834\u3059\u308b\u30d1\u30f3\u3068\u3057\u3066\u306f\u304b\u306a\u308a\u512a\u79c0\u306a\u306e\u3067\u306f\u306a\u3044\u3060\u308d\u3046\u304b\u3002\u3082\u3061\u308d\u3093\u304a\u4ee3\u308aOK\u3002\u98df\u3079\u904e\u304e\u6ce8\u610f\u5831\u767a\u4ee4(\u7b11)\u25cb\u30d5\u30a9\u30a2\u30b0\u30e9\u306e\u30b3\u30f3\u30d5\u30a3\u3000\u80e1\u9ebb\u98a8\u5473\u306e\u30af\u30eb\u30fc\u30c8\u3000\u30eb\u30c3\u30b3\u30e9\u6dfb\u3048\u3000\u3053\u3061\u3089\u306e\u30b9\u30da\u30b7\u30e3\u30ea\u30c6\u306a\u306e\u3060\u305d\u3046\u3002\u80e1\u9ebb\u306e\u30c1\u30e5\u30a4\u30fc\u30eb\u3068\u30d5\u30a9\u30a2\u30b0\u30e9\u306e\u7d44\u307f\u5408\u308f\u305b\u3082\u306a\u304b\u306a\u304b\u3044\u3044\u304b\u3082\u3002\u6dfb\u3048\u3089\u308c\u3066\u3044\u308b\u306e\u306f\u3001\u30b9\u30d1\u30a4\u30b9\u306e\u52b9\u3044\u305f\u30d1\u30a6\u30f3\u30c9\u30b1\u30fc\u30ad\u3001\u305d\u3057\u3066\u30aa\u30ec\u30f3\u30b8\u30bd\u30fc\u30b9\u3002\u3053\u306e\u30d1\u30a6\u30f3\u30c9\u30b1\u30fc\u30ad\u3001\u3069\u3063\u3057\u308a\u3068\u3057\u3066