1\u6025\u767e\u8ca8\u5e97\u672c\u5e97\u306e\u3059\u3050\u8fd1\u304f\u3002\u99c5\u3067\u3044\u3046\u3068\u3001\u6e0b\u8c37\u3088\u308a\u3082\u5c11\u3057\u3060\u3051\u795e\u6cc9\u306e\u65b9\u304c\u8fd1\u3044\u304b\u3082\u77e5\u308c\u307e\u305b\u3093\u3002\u30d3\u30eb\u306e2F\u3078\u306e\u968e\u6bb5\u3092\u4e0a\u304c\u308b\u3068\u3001\u3086\u3063\u305f\u308a\u3068\u3057\u305f\u5e2d\u914d\u7f6e\u306e\u843d\u3061\u7740\u3044\u305f\u7a7a\u9593\u304c\u5e83\u304c\u3063\u3066\u3044\u307e\u3057\u305f\u3002\u591c\u306e\u6599\u7406\u306f\u3001\u524d\u83dc\u30fb\u30b9\u30fc\u30d7\u30fb\u30e1\u30a4\u30f3\u6599\u7406\u30fb\u30c7\u30b6\u30fc\u30c8\u304c\u30bb\u30c3\u30c8\u306b\u306a\u3063\u305f\u30b3\u30fc\u30b9\u304c\u304a\u5f97\u3068\u306e\u3053\u3068\u30022,800\u5186\u30fb3,600\u5186\u30fb4,500\u5186\u306e3\u3064\u306e\u30b3\u30fc\u30b9\u304c\u3042\u3063\u3066\u3001\u524d\u83dc\u3084\u30e1\u30a4\u30f3\u6599\u7406\u306e\u54c1\u6570\u306e\u5dee\u3067\u4fa1\u683c\u304c\u9055\u3044\u307e\u3059\u3002\u3053\u3053\u306f\u677e\u7af9\u6885\u306e\u7af9\u3092\u9078\u3073\u305f\u304f\u306a\u308b\u5fc3\u7406\u306b\u57fa\u3065\u304d\u30013,600\u5186\u306e\u30b3\u30fc\u30b9\u306b\u3057\u307e\u3057\u305f\u3088\u3002\u3053\u306e\u30b3\u30fc\u30b9\u306f\u3001\u524d\u83dc\u304c2\u54c1\u30fb\u30b9\u30fc\u30d7\uff5e\u30c7\u30b6\u30fc\u30c8\u306f1\u54c1\u305a\u3064\u3002\u305d\u308c\u305e\u308c\u8907\u6570\u306e\u30e9\u30a4\u30f3\u30ca\u30c3\u30d7\u304b\u3089\u9078\u3079\u308b\u306e\u3067\u3001\u307e\u305a\u306f\u30d3\u30fc\u30eb\u3092\u9802\u304d\u3064\u3064\u8003\u3048\u307e\u3059\u3002\u30d3\u30fc\u30eb\u306f\u306a\u3093\u3068\u300c\u30d3\u30fc\u30c4\u30d3\u30fc\u30eb \uffe5750\u300d\u3002\u3055\u3059\u304c\u30d3\u30fc\u30ac\u30f3\u30ab\u30d5\u30a7\u3089\u3057\u3044\u30e1\u30cb\u30e5\u30fc\u3067\u3059\u3002\u898b\u305f\u76ee\u306f\u4f55\u3068\u3082\u9bae\u3084\u304b\u306a\u8d64\u3002\u826f\u3044\u610f\u5473\u3067\u571f\u306e\u9999\u308a\u304c\u611f\u3058\u3089\u308c\u307e\u3059\u3002\u5473\u308f\u