u30fc\u30b8\u30a2\u30e0\u306b\u8fd1\u3044\u8def\u5730\u306e2\u968e\u306b9\u670829\u65e5\u306b\u30aa\u30fc\u30d7\u30f3\uff01\u5165\u308a\u53e3\u306e\u660e\u308b\u3044\u96f0\u56f2\u6c17\u3082\u826f\u3044\u3051\u3069\u3001\u5965\u306e\u30ec\u30b9\u30c8\u30e9\u30f3\u3082\u3068\u3063\u3066\u3082\u7d20\u6575\u266a\u25c6BLUETREE \u30c7\u30a3\u30ca\u30fc\u30b3\u30fc\u30b9\u30e1\u30cb\u30e5\u30fc\u306f\u3001\u524d\u83dc\u3001\u30b9\u30fc\u30d7\u3001\u30e1\u30a4\u30f3\u3001\u30c7\u30b6\u30fc\u30c8\u304c\u9078\u3079\u308b\u30d7\u30ea\u30d5\u30a3\u30af\u30b9\u30b9\u30bf\u30a4\u30eb\u3002\u305d\u308c\u305e\u308c1\u54c1\u305a\u3064\u30c1\u30e7\u30a4\u30b9\u304c\u57fa\u672c\u3067\u30c7\u30a3\u30ca\u30fc\u30012800\u5186\uff08\u540c\u3058\u30e2\u30ce\u304c\u30e9\u30f3\u30c1\u3067\u306f1800\u5186\uff09\uff1c\u524d\u83dc2\u54c1\u3060\u30683600\u5186\u3001\u524d\u83dc2\u54c1\uff0b\u30e1\u30a4\u30f32\u54c1\u30674500\u5186\u306a\u3069\u306e\u9078\u629e\u3082\u53ef\u80fd\u3002\uff1e \u79c1\u306f\u3001\u524d\u83dc2\u54c1\u3092\u30c1\u30e7\u30a4\u30b9\u3057\u307e\u3057\u305f\uff01\u30d5\u30a1\u30e9\u30d5\u30a7\u30eb\u3068\u30d3\u30fc\u30ac\u30f3\u30c1\u30fc\u30ba\u3001\u30a2\u30b9\u30d1\u30e9\u30bf\u30eb\u30c8\u8449\u3063\u3071\u306b\u4e57\u3063\u3066\u3044\u308b\u30ab\u30c8\u30e9\u30ea\u30fc\u3084\u3001\u98df\u5668\u3082\u500b\u6027\u7684\u3067\u3059\u306d\uff5e\u266a \u30a2\u30b9\u30d1\u30e9\u30bf\u30eb\u30c8\u4e38\u3044\u30bf\u30eb\u30c8\u751f\u5730\u3092\u4e88\u60f3\u3057\u3066\u3044\u305f\u30a2\u30b9\u30d1\u30e9\u30bf\u30eb\u30c8\u306f\u3001\u4e88\u60f3\u3092\u88cf\u5207\u308b\u5f62\uff01\uff01\u30b5\u30af\u30b5\u30af\u306e\u30d1\u30a4\u306e\u3088\u3046\u306a\u751f\u5730\u306b\u3001\u30ef\u30a4\u30eb\u30c9\u306b\u30a2\u30b9\u30d1\u30e9\u304c\u4e57\u305b\u3089\u308c\u3066\u3044\u307e\u3057\u305f\u3002\u3053\u308c\u3001\u30a2\u30b9\u30d1\u30e9\u306e\u9999\u308a\u304c\u3059\u3054\u304f\u3066\u3001\u306a\u3093\u3060\u304b\u3081\u3061\u3083\u304f\u3061\u3083\u7f8e\u5473\u3057\u3044\uff01\u30f4\u30a3\u30fc\u30ac\u30f3\u3068\u304b\u30d9\u30b8\u30bf\u30ea\u30a2\u30f3\u306e\u6599\u7406\u3063\u3066\u3001\u30d8\u30eb\u30b7\u30fc\u306a\u3060\u3051\u3058\u3083\u306a\u304f\u3066\u3053\u3093\u306a\u306b\u7f8e\u5473\u3057\u3044\u306e\uff1f\uff01 \u30d5\u30a1\u30e9\u30d5\u30a7\u30eb\u3068\u30d3\u30fc\u30ac\u30f3\u30c1\u30fc\u30ba\u8c46\u4e73\u304b\u3089\u4f5c\u3089\u308c\u305f\u30f4\u30a3\u30fc\u30ac\u30f3\u30c1\u30fc\u30ba\u3082\u3001\u3082\u3061\u308d\u3093\u81ea\u5bb6\u88fd\u3060\u305d\u3046\u3067\u3059\u3002\u80e1\u9ebb\u306e\u30b3\u30af\u3068\u8c46\u4e73\u3067\u3001\u6fc3\u3044\uff01\u3072\u3088\u3053\u8c46\u5165\u308a\u3067\u4e2d\u6771\u306e\u30b3\u30ed\u30c3\u30b1\u306e\u3088\u3046\u306a\u98df\u3079\u7269\u3001\u30d5\u30a1\u30e9\u30d5\u30a7\u30eb\u3082\u7f8e\u5473\u3057\u3044\uff5e\u30b9\u30fc\u30d7\u306f\u3001\u672c\u65e5\u306e\u30af\u30ec\u30f3\u30ba\u30b9\u30fc\u30d7\u3092\u30c1\u30e7\u30a4\u30b9\u3002\u5c71\u828b\u3068\u6885\u306e\u30b9\u30fc\u30d7\u5c71\u828b\u306e\u30c8\u30ed\u307f\u3068\u6885\u306e\u9178\u5473\u304c\u3001\u75b2\u308c\u305f\u8eab\u4f53\u3092\u7652\u3057\u3066\u304f\u308c\u305d\u3046\u306a\u30b9\u30fc\u30d7\u3002\u30b0\u30ea\u30fc\u30f3\u304c\u304b\u3063\u3066\u3044\u308b\u306e\u306f\u3001\u6d77\u8349\u306e\u8272\u306a\u306e\u3060\u305d\u3046\u3002\u6dfb\u3048\u3089\u308c\u305f\u30d1\u30f3\u306f\u3001\u305a\u3063\u3057\u308a\u3057\u305f\u30bf\u30a4\u30d7\u3067\u3059\u3002 \u30e1\u30a4\u30f3\u306f\u3001\u8ff7\u3063\u305f\u6319\u53e5\u30fb\u30fb\u30fb\u8c46\u8150\u306e\u30cf\u30f3\u30d0\u30fc\u30b0\u3068\u30ab\u30ea\u30d5\u30e9\u30ef\u30fc\u30e9\u30a4\u30b9\u79c1\u306f\u3001\u30f4\u30a3\u30fc\u30ac\u30f3\u30c1\u30e7\u30a4\u30b9\u3067\u3057\u305f\u304c\u3001\u9d8f\u80f8\u8089\u3084\u771f\u9bdb\u306a\u3069\u304a\u8089\u3084\u9b5a\u6599\u7406\u3082\u3042\u308a\u307e\u3057\u305f\u3002\u3068\u8a00\u3046\u4e8b\u306f\u3001\u30d9\u30b8\u30bf\u30ea\u30a2\u30f3\u3001\u30f4\u30a3\u30fc\u30ac\u30f3\u3001\u304a\u8089\u3084\u304a\u9b5a\u3082\u98df\u3079\u305f\u3044\u4eba\u3068\u3044\u308d\u3093\u306a\u597d\u307f\u306e\u4eba\u304c\u4e00\u7dd2\u306b\u98df\u4e8b\u306b\u884c\u3051\u308b\u3063\u3066\u4e8b\u3067\u3059\u3088\u306d\uff5e\u8c46\u8150\u30cf\u30f3\u30d0\u30fc\u30b0\u3068\u3072\u3068\u53e3\u30c8\u30ec\u30fc\u30c9\u3057\u305f\u300c\u771f\u9bdb\u306e\u30b8\u30e3\u30ac\u30a4\u30e2\u5305\u307f\u713c\u304d\u300d\uff08\u5199\u771f\u5de6\uff09\u304c\u3001\u672c\u5f53\u306b\u4e88\u60f3\u4ee5\u4e0a\u306e\u7f8e\u5473\u3057\u304f\u3066\u3073\u3063\u304f\u308a\uff01\uff01\u30ab\u30ea\u30ab\u30ea\u306e\u30b8\u30e3\u30ac\u30a4\u30e2\u306b\u5305\u307e\u308c\u305f\u3001\u3075\u3063\u304f\u3089\u3057\u3063\u3068\u308a\u3068\u3057\u305f\u771f\u9bdb\u304c\u6700\u9ad8\u3002 \u3046\u3063\u304b\u308a\u5199\u771f\u306b\u64ae\u308a\u5fd8\u308c\u3066\u3044\u307e\u3059\u304c\u3001\u9014\u4e2d\u30d3\u30fc\u30c4\u30d3\u30fc\u30eb\u3084\u30d3\u30aa\u30ef\u30a4\u30f3\u3082\u305f\u3057\u306a\u307f\u307e\u3057\u305f\uff57 \u30c7\u30b6\u30fc\u30c8\u306f\u3001\u8c46\u8150\u306e\u30c6\u30a3\u30e9\u30df\u30b9 \u3092\u30c1\u30e7\u30a4\u30b9\u3053\u306e\u5bb9\u5668\u3001\u53ef\u611b\u3044\uff5e\uff5e\uff5e\u30af\u30ea\u30fc\u30df\u30fc\u3067\u3001\u30b3\u30b3\u30a2\u306e\u30d1\u30d5\u306e\u98df\u611f\u3068\u3001\u3061\u3087\u3063\u3068\u3057\u305f\u5869\u6c17\u304c\u30d0\u30e9\u30f3\u30b9\u826f\u304b\u3063\u305f\u3067\u3059\u3002 \u3064\u304d\u306a\u307f\u3067\u3059\u304c\u3001\u5927\u6e80\u8db3\uff01\u30f4\u30a3\u30fc\u30ac\u30f3\u6599\u7406\u3063\u3066\u5965\u304c\u6df1\u3044\u30fb\u30fb\u30fb\u307e\u305f\u8fd1\u3044\u3046\u3061\u306b\u3001\u305c\u3072\u884c\u304d\u305f\u3044\u304a\u5e97\u3067\u3059\u3002\u3054\u99b3\u8d70\u69d8\u3067\u3057\u305f\uff5e", "4999", "4000", "\u591c", "3.9", "405", "133", "9"], ["\u6e0b\u8c37\u306b\u3001\u307e\u305f1\u3064\u304a\u6c17\u306b\u5165\u308a\u306e\u5e97\u304c\u5897\u3048\u307e\u3057\u305f\u3002\u30cf\u30ef\u30a4\u3001\u30de\u30a4\u30a2\u30df\u306b\u7d9a\u304d\u30d3\u30fc\u30ac\u30f3\u6599\u7406\u306e\u300cBLUE TREE\u300d\u65e5\u672c\u521d\u4e0a\u9678\uff01", "        \u30bb\u30f3\u30bf\u30fc\u8857\u306b\u65b0\u3057\u3044\u304a\u5e97\u304c\u30aa\u30fc\u30d7\u30f3\u3057\u3066\u3044\u307e\u3057\u305f\u3002\u805e\u3051\u3070\u5065\u5eb7\u3092\u30c6\u30fc\u30de\u306b\u3057\u305f\u30d3\u30fc\u30ac\u30f3\u30ec\u30b9\u30c8\u30e9\u30f3\u306729\u65e5\u306b\u30aa\u30fc\u30d7\u30f3\u3057\u305f\u3070\u304b\u308a\u3068\u304b\u3002\u30d7\u30ea\u30d5\u30a3\u30af\u30b9\u30b9\u30bf\u30a4\u30eb\u3067\u3044\u305f\u3060\u304f\u30d3\u30fc\u30ac\u30f3\u6599\u7406\u3068\u30ef\u30a4\u30f3\u306e\u30e9\u30a4\u30f3\u30ca\u30c3\u30d7\u304c\u6c17\u306b\u306a\u308a\u304a\u90aa\u9b54\u3057\u3066\u307f\u308b\u3053\u3068\u306b\u3057\u307e\u3057\u305f\u3002\u5834\u6240\u306f\u300c\u3044\u304d\u306a\u308a\u30b9\u30c6\u30fc\u30ad\u300d\u306e2F\u3002\u30b7\u30f3\u30dc\u30eb\u30de\u30fc\u30af\u306e\u300cBLUE TREE\u300d\u304c\u76ee\u5370\u3067\u3059\u3002\u5165\u3063\u305f\u77ac\u9593\u3042\u307e\u308a\u306b\u3082\u30ab\u30d5\u30a7\u8272\u306e\u5f37\u3044\u5e97\u5185\u306b\u82e5\u5e72\u4e0d\u5b89\u306b\u306a\u308a\u307e\u3057\u305f\u304c\u5965\u306b\u306f\u3057\u3063\u304b\u308a\u3068\u843d\u3061\u7740\u3051\u308b\u7a7a\u9593\u304c\u5e83\u304c\u3063\u3066\u3044\u307e\u3057\u305f\u3002\u30c9\u30ea\u30f3\u30af\u3082\u30b3\u30fc\u30eb\u30c9\u30d7\u30ec\u30b9\u30b8\u30e5\u30fc\u30b9\u3084\u30b3\u30f3\u30d6\u30c1\u30e3\u30aa\u30fc\u30ac\u30cb\u30c3\u30af\u30b3\u30fc\u30d2\u30fc\u304c\u4e26\u3076\u4e2d\u3001\u3057\u3063\u304b\u308a\u3068\u30a2\u30eb\u30b3\u30fc\u30eb\u306e\u30da\u30fc\u30b8\u3082\u3042\u3063\u3066\u3072\u3068\u5b89\u5fc3\u3002\u5148\u305a\u306f\u30d3\u30fc\u30c4\u30d3\u30fc\u30eb\u3092\uff01\u98f2\u307f\u3084\u3059\u304f\u3001\u9bae\u3084\u304b\u306a\u30d4\u30f3\u30af\u8272\u304c\u53ef\u611b\u3044\u30d3\u30fc\u30eb\u3067\u3059\u3002\u305d\u3057\u3066\u4eca\u56de\u306f\u521d\u3081\u3066\u3068\u3044\u3046\u3053\u3068\u3067\u524d\u83dc2\u7a2e\u306b\u30b9\u30fc\u30d7\u30e1\u30a4\u30f3\u3068\u30c7\u30b6\u30fc\u30c8\u304c\u9078\u3079\u308b@3800\u5186\u306e\u30b3\u30fc\u30b9\u3092\u30c1\u30e7\u30a4\u30b9\u3057\u3066\u307f\u307e\u3057\u305f\u3002\u524d\u83dc\u304c1\u7a2e\u985e\u3060\u3068@2800\u5186\u30013\u7a2e\u985e\u3060\u3068@4800\u5186\u306e\u30b3\u30fc\u30b9\u306b\u306a\u308b\u3088\u3046\u3067\u3059\u3002\u524d\u83dc\u306f8\u7a2e\u304b\u3089\u3002\u306a\u3093\u3068\u3082\u9b45\u529b\u7684\u306a\u30e1\u30cb\u30e5\u30fc\u306e\u4e2d\u304b\u3089\u60a9\u307f\u306b\u60a9\u3093\u3067\u30a2\u30b9\u30d1\u30e9\u30bf\u30eb\u30c8\u3068\u9752\u30d1\u30d1\u30a4\u30e4\u3068\u9752\u30c8\u30de\u30c8\u306e\u30b5\u30e9\u30c0\u3092\u3002\u3053\u306e\u30a2\u30b9\u30d1\u30e9\u306e\u30bf\u30eb\u30c8\u304c\u7f8e\u5473\u3057\u304f\u3066\uff01\u307f\u305a\u307f\u305a\u3057\u304f\u3066\u5473\u306e\u6fc3\u3044\u30a2\u30b9\u30d1\u30e9\u306b\u30d0\u30bf\u30fc\u4e0d\u4f7f\u7528\uff1f\u3042\u3063\u3055\u308a\u3068\u3057\u305f\u30bf\u30eb\u30c8\u304c\u7d76\u54c1\u3002\u9752\u30d1\u30d1\u30a4\u30e4\u3068\u9752\u30c8\u30de\u30c8\u306e\u30b5\u30e9\u30c0\u3082\u9175\u7d20\u305f\u3063\u3077\u308a\u3002\u98df\u611f\u3068\u9178\u5473\u304c\u7d76\u5999\u3067\u3059\u306d\u3002\u3053\u308c\u306b\u306f\u6ce1\u3092\u5408\u308f\u305b\u305f\u3044\uff01\u3059\u3063\u304d\u308a\u3068\u3057\u305f\u30b9\u30d1\u30fc\u30af\u30ea\u30f3\u30b0\u30ef\u30a4\u30f3\u306f\u30aa\u30fc\u30ac\u30cb\u30c3\u30af\u3002\u30b9\u30fc\u30d7\u306f3\u7a2e\u304b\u3089\u672c\u65e5\u306e\u30af\u30ec\u30f3\u30ba\u30b9\u30fc\u30d7\u3092\u3002\u5c71\u828b\u3068\u6885\u306e\u30b9\u30fc\u30d7\u3002\u3053\u308c\u304c\u4e88\u60f3\u3092\u4e0a\u56de\u308b\u7f8e\u5473\u3057\u3055\uff01\u30d3\u30b8\u30e5\u30a2\u30eb\u3092\u88cf\u5207\u308b\u6885\u306e\u4e3b\u5f35\u304c\u5fc3\u5730\u3088\u304f\u3001\u697d\u3057\u3044\u30b9\u30fc\u30d7\u3067\u3057\u305f\u3002\u30ef\u30a4\u30f3\u306f\u30ab\u30ce\u30f3\u30fb\u30c7\u30e5\u30fb\u30de\u30ec\u30b7\u30e3\u30eb\u3000\u30aa\u30de\u30fc\u30b8\u30e5 \u30eb\u30fc\u30b8\u30e5\u3002\u3082\u3061\u308d\u3093Bio\u3067\u3059\u304c\u3001\u307e\u308d\u3084\u304b\u3067\u9aa8\u683c\u306e\u3057\u3063\u304b\u308a\u3057\u305f1\u676f\u3067\u3059\u3002\u30e1\u30a4\u30f3\u306f\u771f\u9bdb\u306e\u3058\u3083\u304c\u828b\u5305\u307f\u713c\u304d\u3092\u3002\u5916\u5074\u306f\u30ab\u30ea\u3063\u3068\u3001\u5185\u5074\u306f\u3057\u3063\u3068\u308a\u3001\u305d\u3057\u3066\u771f\u9bdb\u306f\u3077\u3063\u308a\u3077\u308a\u3002\u6708\u4e26\u307f\u306a\u8868\u73fe\u3057\u304b\u3067\u304d\u307e\u305b\u3093\u304c\u3001\u60b6\u7d76\u306e\u9038\u54c1\uff01\u30d3\u30fc\u30ac\u30f3\u3068\u306f\u3044\u3048\u3001\u666e\u901a\u306b\u8089\u3082\u9b5a\u3082\u9078\u3079\u308b\u306e\u304c\u5b09\u3057\u3044\u3067\u3059\u306d\u3002\u9d28\u3082\u6c17\u306b\u306a\u308a\u307e\u3057\u305f\u3002\u30c7\u30b6\u30fc\u30c8\u306f\u672c\u65e5\u306e\u3055\u3063\u3071\u308a\u3068\u30b0\u30e9\u30cb\u30c6\u3092\u3002\u8c46\u8150\u306e\u30c6\u30a3\u30e9\u30df\u30b9\u306b\u9650\u3063\u3066\u306f\u690d\u6728\u9262\u4ed5\u7acb\u3066\u3067\u30b9\u30b3\u30c3\u30d7\u304c\u523a\u3055\u3063\u3066\u3044\u307e\u3059\u3002\u53ef\u611b\u3044\uff01\u30d5\u30eb\u30b3\u30fc\u30b9\u3044\u305f\u3060\u3044\u3066\u3082\u8ca0\u62c5\u304c\u306a\u304f\u3001\u3080\u3057\u308d\u8eab\u4f53\u304c\u559c\u3076\u6599\u7406\u306e\u6570\u3005\u3002\u305d\u3057\u3066\u30d3\u30fc\u30ac\u30f3\u306b\u5bfe\u3059\u308b\u6982\u5ff5\u3092\u5857\u308a\u66ff\u3048\u308b\u7f8e\u3057\u3044\u76db\u308a\u4ed8\u3051\u3084\u5473\u308f\u3044\u306b\u611f\u52d5\u3057\u3063\u3071\u306a\u3057\u3002\u6e0b\u8c37\u306b\u3001\u307e\u305f1\u3064\u304a\u6c17\u306b\u5165\u308a\u306e\u5e97\u304c\u5897\u3048\u307e\u3057\u305f\u3002\u5b63\u7bc0\u6bce\u306b\u8a2a\u308c\u305f\u30441\u8ed2\u3067\u3059\u3002", "5999", "5000", "\u591c", "4.1", "3,504", "845", "256"], ["\u30cf\u30ef\u30a4\u767a\u30d3\u30fc\u30ac\u30f3\u5c02\u9580\u5e97\u304c\u6e0b\u8c37\u3078\u9032\u51fa\uff01\u304a\u8089\u6599\u7406\u3082\u9078\u3079\u308b\u30e9\u30f3\u30c1\u30b3\u30fc\u30b9\uff01", "        \u6e0b\u8c3