, ["\u30c7\u30a3\u30ca\u30fc\u25c6BISTRO CAVA,CAVA \u30d3\u30b9\u30c8\u30ed \u30b5\u30f4\u30a1\u30b5\u30f4\u30a1\uff20\u65b0\u5bbf\uff5c\u6771\u4eac\u30e2\u30fc\u30cb\u30f3\u30b0\u65e5\u548c", "        \u65b0\u5bbf\u30c7\u30a3\u30ca\u30fc\u3002\u304a\u8a95\u751f\u65e5\u9593\u8fd1\u3060\u3063\u305f\u3053\u306e\u65e5\u306f\u3001\u65b0\u5bbf\u3067\u3061\u3087\u3063\u3068\u5c0f\u7c8b\u306a\u3072\u3068\u6642\u3092\u3002\u304a\u4f3a\u3044\u3057\u305f\u306e\u306f\u3001BISTROCAVA,CAVA\uff08\u30d3\u30b9\u30c8\u30ed\u30b5\u30f4\u30a1\u30b5\u30f4\u30a1\uff09\uff01\u9756\u56fd\u901a\u308a\u6cbf\u3044\u3001\u65b0\u5bbf\u533a\u5f79\u6240\u306e\u3059\u3050\u8fd1\u304f\u3002\u65b0\u5bbf\u99c5\u304b\u3089\u3082\u65b0\u5bbf\u4e09\u4e01\u76ee\u99c5\u304b\u3089\u3082\u884c\u304d\u3084\u3059\u3044\u5834\u6240\u3067\u3059\u3002\u304a\u5e97\u306f\u30d3\u30eb\u306e4\u968e\u306b\u3042\u3063\u3066\u3001\u901a\u308a\u306e\u55a7\u9a12\u304c\u5618\u306e\u3088\u3046\u306b\u843d\u3061\u7740\u3044\u305f\u6642\u9593\u304c\u6d41\u308c\u3066\u3044\u307e\u3059\u3002\u30b7\u30c3\u30af\u306a\u8272\u5408\u3044\u306e\u5e97\u5185\u306b\u8d64\u3044\u30ca\u30d5\u30ad\u30f3\u304c\u76ee\u3092\u5f15\u304d\u307e\u3059\u3002\u3044\u305f\u3060\u3044\u306e\u306f\u3001\u4e00\u4eba5000\u5186\u306e\u30b3\u30fc\u30b9\u3002\u30c9\u30ea\u30f3\u30af\u306f\u5225\u3067\u3001\u597d\u304d\u306a\u3082\u306e\u3092\u30aa\u30fc\u30c0\u30fc\u3092\u3057\u3064\u3064\u697d\u3057\u307f\u307e\u3057\u305f\u3002\u3053\u3061\u3089\u306e\u304a\u5e97\u306b\u306f\u30bd\u30e0\u30ea\u30a8\u3055\u3093\u304c\u3044\u3089\u3057\u3066\u3001\u300e\u30bd\u30e0\u30ea\u30a8\u304a\u307e\u304b\u305b\u30ef\u30a4\u30f3\u30da\u30a2\u30ea\u30f3\u30b0\u30bb\u30c3\u30c8\u300f\u3092\u30b3\u30fc\u30b9\u306b\u30d7\u30e9\u30b93000\u5186\u3067\u4ed8\u3051\u308b\u3053\u3068\u3082\u3067\u304d\u307e\u3059\u3088\u3002\u4e7e\u676f\u306f\u3001\u3082\u3061\u308d\u3093\u6ce1\u3067\u3002\u30b7\u30e3\u30c8\u30fc\u30fb\u30c9\u30fb\u30ed\u30ec\u30af\u30ec\u30de\u30f3\u30fb\u30c9\u30fb\u30ed\u30de\u30fc\u30eb\u30d6\u30ea\u30e5\u30c3\u30c8\u30fb\u30bc\u30ed\u3002\u7f8e\u3057\u3044\u30a4\u30a8\u30ed\u30fc\u306b\u30ad\u30e1\u7d30\u304b\u306a\u6ce1\u306b\u3068\u304d\u3081\u3044\u3066\u3057\u307e\u3046\u3002\u30d5\u30eb\u30fc\u30c6\u30a3\u30fc\u306a\u9999\u308a\u304c\u5e83\u304c\u308a\u3064\u3064\u3082\u3001\u30c9\u30e9\u30a4\u3067\u304d\u308a\u3063\u3068\u3057\u305f\u5f8c\u5473\u3067\u3059\u3002\u30a2\u30df\u30e5\u30fc\u30ba\u306f\u3001\u751f\u6625\u5dfb\u304d\u306a\u3089\u306c\u3001\u751f\u30cf\u30e0\u5dfb\u304d\uff01\u30de\u30c9\u30ec\u30fc\u30cc\u578b\u306b\u306e\u3063\u3066\u3044\u308b\u3068\u3044\u3046\u53ef\u611b\u3055\u3002\u751f\u30cf\u30e0\u3068\u304a\u91ce\u83dc\u3001\u305d\u3057\u3066\u3001\u30a2\u30cd\u30c3\u30c8\u3068\u3044\u3046\u30cf\u30fc\u30d6\u3092\u5dfb\u3044\u3066\u3042\u308a\u3001\u30a2\u30f3\u30c1\u30e7\u30d3\u306e\u30af\u30ea\u30fc\u30e0\u30bd\u30fc\u30b9\u304c\u6dfb\u3048\u3089\u3066\u307e\u3059\u3002\u30a2\u30cd\u30c3\u30c8\u3063\u3066\u805e\u304d\u6163\u308c\u306a\u3044\u30cf\u30fc\u30d6\u3060\u3068\u601d\u3063\u305f\u306e\u3060\u3051\u308c\u3069\u3001\u98df\u3079\u3066\u307f\u305f\u3089\u3001\u5927\u597d\u304d\u306a\u30c7\u30a3\u30eb\u306e\u98a8\u5473\u304c\uff01\u30c7\u30a3\u30eb\u3063\u3066\u3001\u30d5\u30e9\u30f3\u30b9\u8a9e\u3067\u306f\u30a2\u30cd\u30c3\u30c8\u3068\u8a00\u3046\u306e\u3060\u305d\u3046\u3002\u3072\u3068\u3064\u304a\u52c9\u5f37\u306b\u3002\u30af\u30ec\u30fc\u30e0\u30fb\u30c9\u30fb\u30de\u30a4\u30b9\u3068\u716e\u7a74\u5b50\u3002\u671d\u63a1\u308c\u306e\u201c\u304d\u307f\u3072\u3081\u201d\u3068\u3044\u3046\u30c8\u30a6\u30e2\u30ed\u30b3\u30b7\u3092\u4f7f\u3063\u305f\u30b9\u30fc\u30d7\u306b\u3001\u716e\u7a74\u5b50\u304c\u6dfb\u3048\u3066\u3042\u308a\u307e\u3059\u3002\u305d\u3057\u3066\u3001\u6563\u3089\u3057\u3066\u3042\u308b\u306e\u306f\u3001\u3059\u3060\u3061\u3002\u716e\u7a74\u5b50\u306e\u4e0b\u306b\u306f\u30b5\u30af\u30b5\u30af\u98df\u611f\u306b\u4ed5\u4e0a\u3052\u305f\u304a\u7c73\u3092\u8a70\u3081\u305f\u856a\u304c\u96a0\u308c\u3066\u3044\u308b\u3068\u3044\u3046\u3068\u3063\u3066\u3082\u624b\u306e\u8fbc\u3093\u3060\u4e00\u54c1\u3067\u3059\u3002\u3053\u306e\u98df\u611f\u306e\u30cf\u30fc\u30e2\u30cb\u30fc\u306b\u3046\u3063\u3068\u308a\u3002\u80e1\u6843\u306e\u30ed\u30fc\u30eb\u30d1\u30f3\u3002\u7121\u5869\u30d0\u30bf\u30fc\u306b\u30d5\u30eb\u30fc\u30eb\u30fb\u30c9\u30fb\u30bb\u30eb\u3092\u6df7\u305c\u3066\u3042\u308a\u3001\u3055\u3089\u306b\u3001\u7af9\u70ad\u5869\u304c\u306e\u3063\u3066\u307e\u3059\u3002\u662f\u975e\u305f\u3063\u3077\u308a\u3081\u306b\u30d0\u30bf\u30fc\u3092\u30fb\u30fb\u30fb\u3068\u306e\u3053\u3068\u3067\u3001\u3044\u3064\u3082\u3088\u308a\u8d05\u6ca2\u306b\u30d0\u30bf\u30fc\u3092\u306e\u305b\u3066\u98df\u3079\u3066\u307f\u308b\u3002\u4e0d\u898f\u5247\u306a\u5869\u6c17\u306b\u305d\u305d\u3089\u308c\u3066\u3001\u98df\u3079\u59cb\u3081\u305f\u3089\u6b62\u307e\u3089\u306a\u3044\uff01\u591c\u306a\u306e\u306b\u3001\u307e\u3055\u304b\u306e\u30d1\u30f3\u304a\u304b\u308f\u308a\u3092\u3044\u305f\u3060\u3044\u3066\u3057\u307e\u3046\u7a0b\u3002\u30d5\u30a9\u30a2\u30b0\u30e9\u306e\u30c6\u30ea\u30fc\u30cc\u3002\u307e\u308b\u3067\u7d75\u753b\u306e\u3088\u3046\u3002\u3053\u3046\u3044\u3046\u4f59\u767d\u306e\u7f8e\u3057\u3044\u76db\u308a\u4ed8\u3051\u304c\u3059\u3054\u304f\u597d\u304d\u3067\u3059\u3002\u672c\u5f53\u306b\u3053\u308c\u3092\u98df\u3079\u3066\u3057\u307e\u3046\u306e\uff1f\u3068\u601d\u3046\u304f\u3089\u3044\u306b\u3001\u7f8e\u3057\u3044\u3002\u30d5\u30a9\u30a2\u30b0\u30e9\u306e\u30c6\u30ea\u30fc\u30cc\u306f\u3001\u8272\u3005\u306a\u30c9\u30e9\u30a4\u30d5\u30eb\u30fc\u30c4\u304c\u5165\u3063\u305f\u30b8\u30e5\u30ec\u3068\u91cd\u306d\u3066\u3042\u3063\u3066\u3001\u98df\u611f\u3092\u304d\u3063\u3061\u308a\u63c3\u3048\u308b\u3088\u3046\u306b\u4f5c\u3089\u308c\u3066\u3044\u308b\u3068\u3044\u3046\u3053\u3060\u308f\u308a\u3063\u3077\u308a\u3002\u30dd\u30eb\u30c8\u9152\u3092\u716e\u8a70\u3081\u305f\u30bd\u30fc\u30b9\u3068\u3068\u3082\u306b\u3044\u305f\u