0b9\u3082\u3042\u308a\u307e\u3059\uff09\u3067\u3059\u304c\u30fb\u5185\u5bb9\u306f\u3001\u3053\u306e\u30b3\u30fc\u30b9\u304c5,000\u5186\u3063\u3066\u601d\u3048\u308b\u307b\u3069\u3001\u3068\u3063\u3066\u3082\u30b3\u30b9\u30c8\u30d1\u30d5\u30a9\u30fc\u30de\u30f3\u30b9\u304c\u9ad8\u3044\u307e\u305a\u306f\u3001\u30ef\u30a4\u30f3\u3092\u697d\u3057\u3093\u3067\u3044\u308b\u3068\u30fb\u30fb\u30fb\u6d3b\u304d\u305f\u9577\u5d0e\u770c\u7523\u306e\u59eb\u30a2\u30ef\u30d3\u304c\u767b\u5834\u3057\u307e\u3057\u305f\u3053\u306e\u7372\u308c\u305f\u3066\u306e\u6d3b\u304d\u305f\u59eb\u30a2\u30ef\u30d3\u3082\u3001\u30b3\u30fc\u30b9\u306e\u4e2d\u306b\u767b\u5834\u3057\u307e\u3059\u30a2\u30df\u30e5\u30fc\u30ba\u3000\u7a1a\u9b8e\u306e\u30d5\u30ea\u30c3\u30c8\u3053\u3061\u3089\u306e\u304a\u6599\u7406\u306f\u3001\u76ee\u3082\u304a\u8179\u3082\u304a\u697d\u3057\u307e\u305b\u3066\u304f\u308c\u307e\u3059\u305d\u306e\u65e5\u306b\u5c4a\u3044\u305f\u3070\u304b\u308a\u306e\u7a1a\u9b8e\u3092\u6d3b\u304d\u305f\u307e\u307e\u8abf\u7406\u3057\u3066\u3044\u307e\u3059\u9b8e\u306f\u3001\u9bae\u5ea6\u304c\u843d\u3061\u308b\u3068\u3001\u81ed\u307f\u304c\u51fa\u3066\u3057\u307e\u3044\u307e\u3059\u304c\u30fb\u30fb\u30fb\u672c\u5f53\u306b\u5ddd\u9b5a\u3063\u3066\u601d\u3046\u307b\u3069\u3001\u5168\u304f\u81ed\u307f\u304c\u306a\u304f\u3066\u7f8e\u5473\u3057\u3055\u3060\u3051\u9802\u304f\u3001\u8d05\u6ca2\u306a\u30d5\u30ea\u30c3\u30c8\u304a\u76bf\u306e\u4e0a\u3092\u6e13\u6d41\u306b\u898b\u7acb\u3066\u3001\u7a1a\u9b8e\u304c\u6cf3\u3044\u3067\u3044\u308b\u304b\u306e\u3088\u3046\u306a\u30a2\u30df\u30e5\u30fc\u30ba\u76ee\u3082\u820c\u3082\u3001\u697d\u3057\u307e\u305b\u3066\u304f\u3060\u3055\u3044\u307e\u3059\u751f\u3067\u98df\u3079\u3089\u308c\u3066\u3057\u307e\u3046\u307b\u3069\u7cd6\u5ea6\u306e\u9ad8\u3044\u3068\u3046\u3082\u308d\u3053\u3057\u300c\u304d\u307f\u3072\u3081\u300d\u3082\u7f8e\u5473\u3057\u304b\u3063\u305f\u3067\u3059\u304f\u308b\u307f\u306e\u30d1\u30f3\u30a2\u30eb\u30b3\u30fc\u30eb\u3092\u98f2\u3080