u8338\u306e\u9999\u308a\u306f\u307b\u3093\u306e\uff5e\u308a\u3067\u3057\u305f\u2606 \u3010\u9152\u3000\u80b4\u3011\u7099\u308a\u679d\u8c46 \uff5e\u713c\u304d\u8272\u304c\u3064\u3044\u305f\u9999\u3070\u3057\u3044\u7f8e\u5473\u3057\u3055\uff5e\u3053\u308c\u306f\u2026\u30d3\u30fc\u30eb\u306b\u5408\u3044\u307e\u3059\u306d\uff01\uff08\uff3e\uff50\uff3e\uff09\u5869\u6c17\u304c\u6700\u9ad8\u3067\u3059\uff01\uff01\uff08\u7b11\uff09\u7099\u308a\u679d\u8c46\u597d\u304d\u306a\u306e\u3067\u5b09\u3057\u3044\u3067\u3059\u306d\uff5e\u266a\u304a\u3053\u3052\u306e\u826f\u3044\u9999\u308a\u3067\u304a\u9152\u304c\u9032\u307f\u30de\u30b9\uff01\u500b\u4eba\u7684\u30aa\u30b9\u30b9\u30e1\u306e\u5bb6\u7528\u30ec\u30b7\u30d4\u7099\u308a\u679d\u8c46\u306f\u3001\u30aa\u30ea\u30fc\u30d6\u30aa\u30a4\u30eb\u3068\u5510\u8f9b\u5b50\u3001\u523b\u307f\u30cb\u30f3\u30cb\u30af\u3092\u4f7f\u3063\u305f\u307a\u30da\u30ed\u30f3\u98a8\u3067\u3059\u266a\uff08//\u25bd//\uff09 \u3010\u523a\u3000\u8eab\u3011\u8c6a\u83ef\u523a\u8eab\u4e94\u70b9\u76db\u308a\u5408\u308f\u305b\u304a\u523a\u8eab\u306e\u4e2d\u8eab\u306f\u3001\u771f\u9bdb\u30fb\u307e\u3050\u308d\u8d64\u8eab\u30fb\u30db\u30bf\u30c6\u30fb\u30b5\u30fc\u30e2\u30f3\u30fb\u7518\u30a8\u30d3\u3067\u3059\u2606\u8239\u76db\u306e\u5668\u3067\u51fa\u3066\u304d\u3066\u30d3\u30c3\u30af\u30ea\u3057\u307e\u3057\u305f\uff01(\u7b11\uff09\u76db\u308a\u4ed8\u3051\u304c\u30ad\u30ec\u30a4\u3067\u3057\u305f\u2606\u7518\u30a8\u30d3\u3082\u3001\u30b7\u30c3\u30dd\u3092\u4e0a\u306b\u30af\u30eb\u30f3\u3063\u3066\u76db\u308b\u3068\u30ad\u30ec\u30a4\u306a\u3093\u3067\u3059\u306d\u3047\u30fc\uff01\u30db\u30bf\u30c6\u304c\u30ec\u30e2\u30f3\u306e\u98a8\u5473\u304c\u3064\u3044\u3066\u3044\u3066\u7f8e\u5473\u3057\u304b\u3063\u305f\u3067\u3059\u266a\u30b5\u30fc\u30e2\u30f3\u3082\u8102\u304c\u4e57\u3063\u3066\u3044\u307e\u3057\u305f\uff01\u307e\u3050\u308d\u306e\u8d64\u8eab\u306f\u5c11\u3057\u7b4b\u304c\u6c17\u306b\u306a\u308a\u307e\u3057\u305f\uff5e\u3002\u771f\u9bdb\u306f\u8eab\u304c\